(489, 'es', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bienvenido a Seo Panel – El primer panel de control SEO para la supervisión de sitios web.</h1>\r\n\r\n<p>Un programa <b>open source</b> para la <b>gestión y optimización</b> de sus sitios web ideal para conseguir <b>primeras posiciones en los buscadores</b> más destacados.\r\nEn este panel de control encontraras las herramientas imprescindibles para que su sitio web pueda tener unas posiciones preferentes en los buscadores. Este <b>software es completamente libre</b> y esta bajo la licencia <b>GNU GENERAL PUBLIC LICENSE</b>.</p><p></p>\r\n<p>Una de las mejores características de este panel de control, es la posibilidad de <b>ampliación mediante plugins</b> ya sean realizados por terceros o realizados por nosotros mismos, la incorporación de estos plugins sera sencilla y rápida permitiendo así poder evolucionar la herramienta a la misma velocidad que las nuevas directrices SEO.</p>\r\n', '2011-07-13 02:30:38'),
(4672, 'cs', 'website', 'Edit Website', 'Upravit website', '2011-03-21 07:13:51'),
(490, 'es', 'home', 'home_cont2', '<fieldset>\r\n<legend>Caracteristicas principales de SEO PANEL <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n\r\n<li>\r\n<h1>Herramienta para la automatización de entradas en directorios.</h1>\r\n<p>\r\nEsta herramienta nos permitirá <b>semi automatizar las entradas de nuestras webs a directorios</b> gratuitos y de pago. Una de sus características principales es la posibilidad de seguir y controlar si el directorio finalmente ha dado de alta nuestra web en su directorio de forma automática, siendo el seguimiento de las altas mucho más sencillo y eficaz.\r\n</p>\r\n</li>\r\n \r\n<li>\r\n<h1>Herramienta automática de seguimiento de la posición de una palabra en un buscador.</h1>\r\n<p>\r\nEsta herramienta nos permitirá seguir la <b>evolución de una palabra</b> en un buscador concreto, obteniendo información diaria de su posición y de su evolución, podremos ver y exportar estos datos de forma gráfica o incluso en otros formatos de fichero.\r\n</p>\r\n</li>\r\n<li>\r\n<h1>Site Auditor</h1>\r\n<p><p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page.\r\nEsta herramienta nos permitirá crear en formatos <b>XML, HTML, TEXT</b> los mapas de nuestras páginas webs para facilitar la indexación a los buscadores.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Verificador del ranking en Google y Alexa.</h1>\r\n<p>\r\nDispondrás de una utilidad para seguir diariamente la evolución de tus páginas web en los <b>rankings de Google y Alexa</b>.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Herramienta de backlinks</h1>\r\n<p>\r\nPodrás ver la evolución de los <b>backlinks</b> de tus páginas web de una forma diaria, rapida y efectiva en los buscadores más populares de la red como <b>Google, Yahoo, Msn</b> y más que podres incorporar mediante plugins.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Medidor del índice de saturación</h1>\r\n<p>\r\nPodrás obtener el número de <b>páginas indexadas</b> de tus web y de esta forma ver la evolución diaria de como los buscadores indexan tu página web.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Incorporación de nuevos Plugins</h1>\r\n<p>\r\nEs una de las funciones más potentes de este panel de control, ya que nos permitirá expandir nuestra información a nuestro gusto. Todo el mundo <b>puede desarrollar plugins</b> para nuestra plataforma y de este modo aumentar las posibilidades del panel de control. Si ud. desarrolla una Plugin para nuestro panel de control, lo publicaremos en nuestra página web para que todos los usuarios puedan disfrutar de él.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Generador de Meta-Tags</h1>\r\n<p>\r\nDisponemos de una utilidad para poder generar de forma fácil y cómoda el código necesario para que todos los<b> META TAG</b> de sus paginas web estén generados de una forma correcta y de esta forma incentivar a los buscadores a darnos su mejor posición en el índice.\r\n</p>\r\n</li>\r\n</fieldset>', '2011-07-13 02:30:38'),
