(572, 'es', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Sistema de Soporte</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 Directorios Paquete</h1> \r\n        <p>\r\n            Estamos proporcionando un paquete con <b>1000 directorios en internet activos y verificados</b>, para que los pueda agregar a su Seo Panel dentro de la herramienta para el envio a directorios.\r\n         Le ayudará a aumentar los <b> backlilnks </b> de sus sitios web.\r\n            \r\nEn realidad la lista de 1000 directorios se realizó para recoger algo de dinero para el futuro <b>\r\ndesarrollo </b> de Seo Panel.\r\n\r\n           Para obtener la lista de directorios 1000 por favor <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">realice una donación de </a>\r\n$10 o más para mejorar las características del seo panel.\r\n            Si usted tiene alguna pregunta sobre el paquete de 1000 directorios, por favor <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">contáctenos</a> o abrir un ticket en <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">soporte del sistema</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visite este enlace para donar a seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Paquete de motores de búsqueda local</h1> \r\n        <p>\r\n   \r\nAñada <b> motores de búsqueda locales </b> de google, yahoo, msn (<b>por ejemplo, : www.google.de, www.google.fr Etc </b>) para que Seo Panel verifique sus palabras clave en buscadores a nivel local.\r\n\r\n\r\n           Para obtener el paquete de búsqueda en motores de busqueda locales (de acuerdo a sus necesidades), por favor <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">realice una donación de</a> $ 10 o más para mejorar las características de seo panel.\r\n            Antes de la donación, por favor <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactenos</a> para que nos proporcione la lista de los buscadores locales.\r\n            <br><br>              \r\n            También para agregar <b> nuevos motores de búsqueda (por ejemplo: baidu.com) </b> para poder comprobar sus mejoras en estos buscadores con sus palabras clave,\r\npor favor <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactenos</a> o abra un ticket en<a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">la sección de soporte del sistema</a>. \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita este enlace para contactar con nosotros</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Plugins</h1> \r\n        <p>\r\n        Añada <b> plugins SEO </b> a su panel seo para <b> ampliar las características </b> de acuerdo a sus requisitos.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> son proporcionados por el panel seo\r\ny sitios de terceros.\r\n           También es posible <b> desarrollar  </b> plugins SEO para su panel de seo.\r\n            Usted puede <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">presentar</a> su plugin seo a Seo Panel y\r\nvamos a <b>publicarlo</b> en nuestro sitio web después de nuestra  <b>  revisión</b>.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Visita este enlace para obtener los plugins de Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Contactenos</h1> \r\n        <p>\r\n        Contacte con nosotros para cualquier pregunta sobre las <b>Herramientas Seo Panel, plugins y otras características </b> mediante el uso de este enlace.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita este enlace para contactar con nosotros</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Boletos de Soporte</h1> \r\n        <p>\r\n           Para obtener <b> apoyo técnico</b> del equipo Seo Panel o para configurar el panel de <b>Herramientas Seo o plugins y\r\n otras características </b>. Por ejemplo: Para configurar el cron para la posición corrector de palabras clave.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita este enlace para crear un tiket de soporte</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Informar de bugs</h1> \r\n        <p>\r\n            Informanos de<b>bugs o errores</b> sobre <b>Seo Panel, las herramientas, plugins o características </b> mediante el uso de link de abajo.\r\n           Ayudanos a mejorar las características en las versiones siguientes.       \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita este enlace para informar de los errores</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2011-07-13 12:45:23'),
(573, 'es', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Recursos en linea</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Seo Panel Guía de Ayuda</h1> \r\n        <p>\r\n            Puede ver la <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">seo panel documentación</a> en el\r\n<b>guía de ayuda</b>, que contiene e <b>documentación</b> para el panel de herramientas seo, plugins y afines\r\ncaracterísticas.\r\n            <br>Es el mejor lugar en Internet para obtener <b> ayuda </b> acerca del panel de seo. Esperamos que\r\n<b> contribuir </b> para ayudar a la guía del panel seo, si usted encuentra errores o cosas que faltan.      \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Visita seo panel de guía de ayuda</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Seo Panel Foro</h1> \r\n        <p>\r\n            Un sitio para hablar sobre la primera fuente abierta del mundo <b> seo panel de control </b>.\r\n            Es el mejor lugar para encontrar las <b>respuestas </b> para su <b> preguntas </b> acerca del panel de seo. \r\n            <br>Además, puede <b> comparte </b> el  <b>experiencia</b>, mientras que usando el panel de SEO para optimizar su\r\nsitios web.                             \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Visita seo panel foro</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2011-07-13 12:45:23'),
(574, 'es', 'support', 'support_cont3', '<fieldset>\r\n<legend>Haz una donación a Seo Panel</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Haz una donación a Seo Panel - El primer Open source seo panel de control en el mundo</h1> \r\n        <p>\r\n            <b>Realiza una donación a </b> Seo Panel para ayudar al primer portal Open Source para el control SEO del mundo.\r\n            Estamos planeando añadir y mejorar <b>  características </b> del Seo panel en el futuro.\r\n            <br>Solo con sus <b> apoyos </b> podremos alcanzar nuesttros <b>objetivos</b>.\r\n            Si usted siente que es el panel seo <b> vale la pena </b> para usted, por favor, realice alguna donación para el equipo de Seo Panel.\r\n            <br>Nosostros  <b> publicararemos </b> su nombre y pápgina web en la sección de donaciónes de nuestra página web <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">Página de donaciones</a>, una vez que tengamos su donación.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visita este enlace para donar a seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-13 12:45:23'),
