(696, 'fr', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bienvenue sur le site de Seo Panel - Le premier panneau de contrôle Seo multisite au monde</h1>\r\n        <p>\r\n            <b>Seo Panel</b> est un <b>panneau de contrôle Seo, open source</b>, pour gérer le <b>référencement</b> de vos sites internet.\r\n            Seo Panel est une <b>boite à outils</b> intégrant les tous derniers outils Seo pour <b>suivre et optimiser</b> les <b>résultats</b> de vos sites.\r\n            C\\''est un <b>logiciel libre</b>, sous licence <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n\r\n            L\\''atout majeur de Seo Panel est d\\''être <b>évolutif</b> grâce à son système de <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">plugins Seo</a>.\r\n            Tout le monde peut <b>développer et installer</b> facilement des plugins pour ajouter de nouvelles fonctionnalités.</p>\r\n        <p></p>\r\n        <p>\r\n            Ce logiciel open source a <b>vu le jour en janvier 2010</b>.\r\n            Depuis cette date, des <b>milliers</b> de <b>webmasters</b> utilise ce logiciel pour le référencement de leurs sites.\r\n            Utilisez Seo Panel dès aujourd\\''hui, et <b>appréciez</b> l\\''intégration de <b>toutes les techniques Seo</b> dans un seul et même outil, <b>Seo Panel</b>.\r\n        </p>', '2011-07-10 03:26:55'),
(697, 'fr', 'home', 'home_cont2', '<fieldset>\r\n<legend>Principales fonctionnalités de Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Outil de soumission automatisée</h1>\r\n        <p>\r\n            L\\''outil de soumission automatisée permet de <b>soumettre vos sites internet</b> aux principaux <b>annuaires gratuits et commerciaux</b>.\r\n            Le <b>statut</b> de chaque soumission peut être <b>suivi périodiquement</b> par le <b>script de contrôle</b>.\r\n            Le <b>gestionnaire d\\''annuaires</b> vous aidera à vérifier le statut de chacun des annuaires.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrôle de position sur mot-clé</h1>\r\n        <p>\r\n            L\\''outil de contrôle de position sur mot-clé va trouver et sauvegarder la <b>position de votre site</b> dans les moteurs de recherche pour les <b>mots-clés visés</b>.\r\n            Dans la section des rapports de position, un <b>suivi quotidien et détaillé</b> des positions sur les différents mots-clés dans les moteurs de recherche est présenté <b>sous forme graphique</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Vérificateur de site</h1>\r\n        <p>Le vérificateur de site va <b>vérifier tous les paramètres SEO</b> des pages du site audité, et fournir un <b>rapport détaillé</b> sur chacune des pages. Cela permet de créer des fichiers sitemap <b>XML, HTML, ou texte</b> de votre site, afin de les <b>envoyer aux moteurs de rechercher.</b></p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrôle des rangs Google et Alexa</h1>\r\n        <p>\r\n            L\\''outil de contrôle du rang Google et Alexa va trouver et sauvegarder les <b>rangs Google et Alexa</b> de vos sites.\r\n            Dans la section rapports de rang, un <b>suivi quotidien et détaillé</b> du rang Google et du rang Alexa est effectué, pour chacun de vos sites.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrôle des liens retour</h1>\r\n        <p>\r\n            Le contrôle des liens retour permet de trouver et sauvegarder le <b>nombre de liens retour</b> vers vos sites sur les différents moteurs de recherche <b>(Google, Yahoo, MSN, ...)</b>.\r\n            <br>Dans la section des rapports sur liens retour, vous pouvez voir un <b>comptage quotidien et détaillé des liens retour</b> de chacun des sites.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Contrôle de saturation des moteurs de recherche</h1>\r\n        <p>\r\n            Le contrôle de saturation va trouver et sauvegarder le <b>nombre de pages indexées</b> de vos sites, sur les différents moteurs de recherche <b>(Google, Yahoo, MSN, ...)</b>.<br>\r\n            Dans les rapports de saturation, vous pouvez voir les <b>détails quotidiens</b> du <b>nombre de pages indexées</b> pour chacun de vos sites.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Plugins Seo Panel</h1></h1>\r\n        <p>\r\n        	Le <b>principal atout</b> de Seo Panel est son <b>évolutivité</b>.\r\n        	Ajoutez <b>vos propres plugins</b> pour <b>étendre les fonctionnalités</b> de votre Seo Panel, selon vos besoins.<br/>\r\n            Les <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">plugins Seo Panel</a> sont disponibles via le site Seo Panel, ou par des tiers.\r\n            Vous pouvez facilement <b>développer</b> des plugins pour votre Seo Panel, \r\n            Et vous pouvez aussi <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">soumettre</a> vos plugins à Seo Panel. Ils seront <b>publiés</b> sur notre site, après validation.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Générateur de tags Meta</h1>\r\n        <p>\r\n            Le générateur de tags Meta est un <b>plugin Seo Panel</b> permettant de créer des <b>tags Meta personnalisés</b> pour vos sites.\r\n            Il vous aidera à donner <b>plus d\\''informations</b> sur vos sites aux <b>robots de recherche</b> lors de leurs visites.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-10 03:26:55'),
(698, 'fr', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel - Ressources en ligne</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Références Seo Panel</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Site officiel Seo Panel</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Télécharger Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Site de démonstration Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Contacter l\\''équipe Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Guide Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Forum Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Support Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Faites un don pour Seo Panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-10 03:26:55'),
