(898, 'de', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Willkommen im SEO Panel - Das weltweit erste SEO Kontroll Panel fuer multiple Webseiten</h1>\r\n        <p>\r\n            Ein komplettes <b>Open Source SEO Panel</b> zur <b>Suchmaschinenoptimierung</b> deiner Webseiten.\r\n            Das SEO Panel ist ein <b>SEO Tool Kit</b> mit den wichtigsten Funktionen um die <b>Suchmaschinenoptimierung</b> deiner Eebseiten zu\r\n<b>beobachten und verbessern</b>.\r\n            Es handelt sich um <b>kostenlose Software</b> erschienen unter der <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            Die Hauptfunktion von SEO Panel ist die <b>Erweiterungsfaehigkeit</b> durch das Nutzen von <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">SEO Erweiterungen</a>.\r\n            Jeder kann ganz einfach weitere Erweiterungen fuer das SEO Panel <b>entwickeln und installieren</b>. \r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Diese Open Source Software wurde <b>im Januar 2010 veroeffentlicht</b>.\r\n            In diesem <b>kurzen Zeitraum</b> haben sich bereits <b>Tausende</b> von <b>Webmastern</b> gefunden, die diese Software nutzen um Ihre Webseiten zu <b>optimieren</b>.\r\n            Beginne noch heute, das SEO Panel zu nutzen und <b>geniesse</b> die Vorteile, alles SEO-technische in einer <b>einzigen Platform</b> wiederzufinden.\r\n        </p>', '2011-07-07 12:09:22'),
(899, 'de', 'home', 'home_cont2', '<fieldset>\r\n<legend>Hauptfunktionen des SEO Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatisches Webkatalog Eintragungs Tool</h1>\r\n		<p>\r\n			Das automatische Webverzeichnis Eintragungs Tool ermoeglicht <b>die Eintragung</b> in die wichtigsten <b>kostenlosen und kostenpflichtigen Webkataloge</b>.\r\n			Ausserdem kann der <b>Status jeder Eintragung periodisch ueberprueft werden</b> mithilfe des <b>Status Checker Skripts</b>.\r\n			Der <b>Directory manager</b> ermoeglicht herauszufinden welches <b>Verzeichnis aktiv ist</b> und welches nicht.\r\n		</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Keyword Positions Checker</h1>\r\n		<p>\r\n			Der Keyword Positions Checker findet die <b>Suchmaschinenposition</b> von <b>bestimmten keywords</b> deiner Webseite und <b>speichert</b> diese im System.\r\n			So kann man im Report Bereich das <b>taegliche Ranking</b> von keywords in verschiedenen Suchmaschinen <b>grafisch</b> und <b>detailliert</b> darstellen.\r\n		</p>\r\n    </li>\r\n    <li>\r\n<h1>Website-Doktor</h1>\r\n        <p>Der Website-Doktor <b>prueft alle SEO Faktoren</b> aller Einzelseiten einer Webseite und generiert\r\n<b>detaillierte Berichte</b> fuer jede Seite. Das ist hilfreich um <b>XML,HTML,TEXT</b> Sitemaps zu generieren und an Suchmaschinen zu uebermitteln.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google und Alexa Rank Checker</h1>\r\n		<p>\r\n			Der Google and Alexa Rank Checker zeigt den <b>Google Pagerank</b> und <b>Alexa Rank</b> deiner Webseiten und <b>speichert</b> diesen im System.\r\n			Im <b>Rank Berichte</b> Bereich lassen sich <b>taeglich</b> dafuer <b>detaillierte Berichte</b> erstellen.\r\n		</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Checker</h1>\r\n		<p>\r\n			Der Backlink Checker findet die <b>Anzahl an Backlinks</b> deiner Webseite in diversen Suchmaschinen<b>(google,yahoo,msn etc)</b> und <b>speichert</b> sie im System.\r\n			<br>Im <b>Backlink Berichte</b> Bereich lassen sich <b>taeglich</b> fuer jede Webseite <b>detaillierte Berichte</b> erstellen.\r\n		</p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Suchmaschinensichtbarkeits Checker</h1>\r\n		<p>\r\n			Der Suchmaschinensichtbarkeits Checker findet die <b>Anzahl der indizerten Seiten</b> deiner Webseiten in diversen Suchmaschinen<b>(google,yahoo,msn etc)</b> und <b>speichert</b> sie im System.\r\n			Im <b>Suchmaschinensichtbarkeits Berichte</b> Bereich lassen sich <b>taeglich</b> fuer jede Webseite <b>detaillierte Berichte</b> erstellen.\r\n		</p>\r\n    </li>\r\n    <li>        \r\n        <h1>SEO Panel Erweiterungen</h1>\r\n        <p>\r\n            Eine  <b>Hauptfunktion</b> des SEO Panel ist die <b>Erweiterungsfaehigkeit</b>.\r\n            Entwickle oder installiere <b>SEO Erweiterungen</b> in deinem eigenen SEO Panel um die <b>Funktionen zu erweitern</b>, dass Sie deine Anforderungen erfuellen.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo Panel Erweiterungen</a> werden angeboten vom SEO Panel Team und von Dritten.\r\n            Du kannst auch einfach eigene SEO Erweiterungen fuer dein SEO Panel <b>entwickeln</b>.\r\n            Du kannst ausserdem deine SEO Erweiterung <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">an die Entwickler schicken</a> und es wird auf der SEO Panel Webseite <b>veroeffentlicht</b>, nachdem es <b>ueberprueft</b> wurde.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Generator</h1>\r\n		<p>\r\n			Der Meta Tag Generator ist eine <b>Seo Panel Erweiterung</b> zum Erstellen von <b>Meta Tags</b> fuer deine Seite.\r\n			Es hilft uns <b>mehr Informationen</b> ueber Webseiten an die <b>Suchmaschinenrobots</b> zu uebermitteln.\r\n		</p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-07 12:09:22'),
(900, 'de', 'home', 'home_cont3', '<fieldset>\r\n<legend>SEO Panel Online Ressourcen</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>SEO Panel Online Ressourcen zum Nachschlagen</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Offizielle SEO Panel Webseite</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">SEO Panel downloaden</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Seo Panel Kontakt</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Hilfe</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Support System</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Fuer SEO Panel spenden</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-07 12:09:22'),
