(1238, 'it', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Benvenuto nel Pannello Seo - Il primo pannello di controllo seo al monto per più siti web</h1>\r\n        <p>\r\n            Un <b>pannello di controllo open source </b> completo per gestire <b>l\\''ottimizzazione nei motori di ricerca</b> dei tuoi siti web.\r\n            Il pannello seo è uno<b>stumento</b> che include gli ultimi strumenti seo aggiornati per<b>incrementare e tracciare</b> le\r\n<b>performace</b> dei tuoi siti web.\r\n            E\\'' un <b>software gratuito</b> rilasciato sotto <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            Le caratteristiche principali del pannello seo sono l\\''<b> estendibilità</b>grazie all\\''utilizzo di <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">plugin seo</a>.\r\n            Chiunque può facilmente <b>sviluppare e installare</b> i plugin richiesti dal proprio pannello seo. \r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Questo software open source è stato rilasciato <b>nel gennaio 2010</b>.\r\n            In questo <b>breve periodo</b> di tempo <b>migliaia</b> di <b>web masters</b> hanno utilizzato questo software per<b>ottimizzare</b> i propri siti web.\r\n            Utilizza il pannello seo oggi per te stesso e <b>gusta</b> tutti questi strumenti seo unificati in una<b>sola piattaforma</b>.\r\n        </p>', '2011-07-10 13:10:02'),
(1239, 'it', 'home', 'home_cont2', '<fieldset>\r\n<legend>Maggiori caratteristiche del Pannello Seol <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Strumento di invio automatico nelle directory</h1>\r\n        <p>\r\n        \r\n            Strumento automatico per l\\''invio nelle directory che ti aiuterà a <b>segnalare il tuo sito web</b> nelle maggiori<b> directory gratuite e a pagamento</b>.\r\n            Possiamo anche <b>tracciare lo stato</b> di ogni invio attraverso una <b>verifica periodica</b> utilizzando lo <b>script di verifica stato</b>.\r\n            <b>Directory manager</b> will help us to find out whether <b>directory is active</b> or not.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Verifica posizione keyword</h1>\r\n        <p>\r\n            Verifica la posizione della keyword trovando la <b>posizione nelle ricerche dei motori </b> delle <b>keyword mirate</b>\r\ndel tuo sito web e <b>che si trovano </b> nel sistema.\r\n            Nei report delle posizioni delle keyword possiamo vedere  <b>il posizionamento giornaliero</b> delle  keywords nei differenti motori di ricerca attraverso un <strong> bellissimo grafico </strong>e <b>report dettagliati</b>.        </p>\r\n  </li>\r\n    <li>        \r\n        <h1>Site Auditor</h1>\r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. Questo ti aiuterà a creare file sitemap in formato  <b>XML,HTML,TEXT</b>del tuo sito web <strong>inviandole </strong>ai motori di ricerca.</p>\r\n  </li>\r\n    <li>        \r\n        <h1>Verifica Google and Alexa Rank</h1>\r\n  <p>\r\n            La verifica di Google e alexa rank troverà il <b>pagerank di google</b> e il <b>rank di alexa</b> dei tuoi siti web e <b>memorizzarli</b> nel sistema.\r\n            Nella sezione dei <b>report dei rank</b>, possiamo visualizzare <b>giornalmente</b> il rank di google e di alexagdi ogni sito web con i <b>report dettagliati</b>.        </p>\r\n  </li>\r\n    <li>        \r\n        <h1>Verifica Backlinks</h1>\r\n  <p>\r\n            La verifica dei backlinks ti troverà il <b>numero di backlinks</b> verso i nostri siti web nel differenti motori di ricerca <b>(google,yahoo,msn etc)</b> e li <b>memorizzerà</b> nel sistema.<br>\r\n      Nella sezione <b>report backlink</b>, potremo vedere il <b>conteggio giornaliero dei backlink</b> di ogni sito web nel <b>report giornaliero</b>.\r\n        </p>\r\n  </li>    \r\n    <li>        \r\n        <h1>Verifica Saturazione Motori di Ricerca</h1>\r\n  <p>\r\n            La verifica della saturazione dei Motori di Ricerca troverà il <b>numero di pagine indicizzate</b> dei nostri siti web nei differenti motori di ricerca <b>(google,yahoo,msn ecc)</b> e li<b>memorizzerà</b> nel sistema.\r\n      Nella sezione <b>report di verifica di saturazione dei motori di ricerca </b>, noi possiamo vedere <b>il conteggio delle pagine indicizzate giornalmente</b> per ogni sito web con i <b>report dettagliati</b>.        </p>\r\n  </li>\r\n    <li>        \r\n        <h1>Seo Panel Plugins</h1>\r\n        <p>\r\n            La <b>maggior caratteristica </b>del pannello seo è la sua  <b>estendibilità</b>.\r\n            Aggiungere  <b>plugin seo</b> al tuo pannello seo per  <b>estendere le sue caratteristiche</b> in base alle tue esigenze.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">I plugin del pannello seo</a> sono prodotti dallo stesso pannello seo e da terzi siti.\r\n            Tu puoi anche <b>sviluppare</b> semplici plugin seo per il tuo pannello seo.\r\n      Puoi  <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">inviaret</a> i tuoi plugin seo al pannello seo e noi li  <b>pubblicheremo</b> nel nostro sito web dopo la <b>verifica</b>.        </p>\r\n  </li>\r\n    <li>        \r\n        <h1>Generatore Meta Tag </h1>\r\n  <p>\r\n            Il generatore di Meta tag è un <b>plugin del pannello seo</b> per creare  <b>meta tags personalizzati </b> per il nostro sito.\r\n            Ti aiuterà ad avere  <b>maggiori informazioni</b> sul nostro sito web con i <b>bot dei motori di ricerca</b>\r\nmentre viene scansionato.        </p>\r\n  </li>\r\n</ul>\r\n</fieldset>', '2011-07-10 13:10:02'),
(1240, 'it', 'home', 'home_cont3', '<fieldset>\r\n<legend>RoSeo Panel Online Resources</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Risorse online del pannello Seo per referenza</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Sito web ufficiale Pannello Seo</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Scarica Pannello Seo </a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demo Pannello Seo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Contatta Pannello Seo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Guida/Aiuto Pannello Seo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Forum Pannello Seo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Sistema di supporto Pannello Seo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Sostieni Pannello Seo</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-10 13:10:02'),
