(1251, 'pl', 'support', 'support_cont1', '<fieldset> \r\n<legend>System Wsparcia Seo Panel</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>Pakiet 1000 Katalogów</h1>  \r\n        <p> \r\n            Dostarczamy <b>1000 darmowych aktywnych i zweryfikowanych</b> katalogów internetowych w jednym pakiecie, gotowe do dodania do Twojego panelu Seo  <b>Narzędzia do submisji Seo</b>. \r\n            Pomoże Ci to <b>powiększyć liczbę backlinków</b> twoich Stron. \r\n            Właściwie to lista 1000 Katalogów jest <b>wprowadzona</b> aby zebrać trochę pieniędzy na <b>rozwijanie funkcjonalności</b> Seo Panel. \r\n            Aby otrzymać listę 1000 internetowych Katalogów prosimy <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">o złożenie donacji</a>\r\n$10 lub więcej aby pomóc nam rozwinąć funkcjonalność Seo Panel. \r\n            Jeżeli masz jakieś pytania dotyczące pakietu 1000 Katalogów, prosimy <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">o kontakt</a> lub utwórz pytanie <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">w systemie wsparcia</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Otwórz link aby złożyć donację dla Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Lokalny pakiet Wyszukiwarek</h1>  \r\n        <p> \r\n            Dodaj <b>lokalne wyszukiwarki</b> google,yahoo,msn(<b>np: www.google.de,www.google.fr\r\nitd.</b>) do Seo Panel <b>sprawdzenie pozycji Keyword\\''ów</b>, aby śledzić wydajność twoich Stron w lokalnych wyszukiwarkach. \r\n            Aby otrzymać pakiet lokalnych wyszukiwarek (w zależności od twoich wymagań) prosimy <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">o donację</a> $10 lub więcej aby pomóc w rozwoju funkcjonalności Seo Panel. \r\n            Przed złożeniem donacji, prosimy <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">o kontakt</a> aby powiadomić nas o żądanej liście lokalnych wyszukiwarek. \r\n            <br><br>               \r\n            Zawsze dodawaj <b>nowe wyszukiwarki (np:baidu.com)</b> do Sprawdzania pozycji Keyword\\''ów w Seo Panel,\r\nprosimy <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">o kontakt</a> lub utworzenie pytania w <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">systemie wsparcia</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Otwórz link aby skontaktować się z nami</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Pluginy Seo Panel</h1>  \r\n        <p> \r\n            Dodaj <b>pluginy seo</b> do Twojego Seo Panel by <b>rozszerzyć funkcjonalność</b> według twoich wymagań. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Pluginy Seo Panel</a> są dostarczane przez Seo Panel oraz zewnętrznych źródeł. \r\n            Możesz także równie łatwo <b>tworzyć</b> pluginy Seo dla Twojego Seo Panel. \r\n            Możesz także <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submitować</a> twoje pluginy do Seo Panel a my je <b>opublikujemy</b>na naszej stronie po uprzednim <b>zatwierdzeniu</b>.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Otwórz link aby sciągnąć pluginy Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Kontakt</h1>  \r\n        <p> \r\n            Skontaktuj się z Nami jeśli masz pytanie dotyczące <b>Narzędzi Seo Panel, pluginów oraz funkcjonalności itp.</b> prze użycie poniższego linka.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Otwórz link aby skontaktować się z Nami</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>System Zapytań</h1>  \r\n        <p> \r\n            Aby uzyskać <b>pomoc techniczną</b> od teamu Seo Panel odnośnie instalacji i ustawień Narzędzi Seo Panel, pluginów i funkcjonalności</b>. Np: Aby ustawić zadania Cron dla automatycznego sprawdzania pozycji Keyword\\''ów. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Otwórz link aby utworzyć zapytanie</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Raportowanie błędów</h1>  \r\n        <p> \r\n            Raportuj <b>błędy</b> w <b>Narzędziach Seo Panel, pluginach i funkcjonalności itp.</b> używając poniższego linka.  \r\n            Prosimy o pomoc w usprawnieniu funkcjonalności w nowych wersjach.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Otwórz link aby raportować błąd</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2010-10-24 23:38:20'),
(1252, 'pl', 'support', 'support_cont2', '<fieldset> \r\n<legend>Seo Panel Zasoby Online</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Pomoc Użytkownika Seo Panel</h1>  \r\n        <p> \r\n            Dokumentacja Seo Panel jest dostępna na <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\"> w\r\n<b>Pomocy Użytkownika</b></a>, zawiera ona <b>dokumentację</b> Narzędzi Seo Panel, plugin\\''ów , i funkcjonalności. \r\n            <br>To jest najlepsze miejsce w internecie aby <b>znaleźć pomoc</b> o Seo Panel. mamy nadzieję że pomożesz \r\n<b>udoskonalić</b> Pomoc Użytkownika, jeśli znajdziesz jakiś błąd lub brak czegoś.                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Zobacz Pomoc Użytkownika Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Forum Seo Panel</h1>  \r\n        <p> \r\n            To miejsce do dyskusji o pierwszym na świecie opensource\\''owym <b> panelem kontrolym seo</b>.  \r\n            To najlepsze miejsce by znaleźć <b>odpowiedź</b> na <b>Twoje pytania</b> o Seo Panel.  \r\n            <br>Możesz także <b>dzielić się</b> twoim <b>doświadczeniem</b> z użytkowanie Seo Panel do optymalizacji twoich Stron.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Odwiedź forum Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2010-10-24 23:38:20'),
(1253, 'pl', 'support', 'support_cont3', '<fieldset> \r\n<legend>Złóż donację dla Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Złóż donację dla Seo Panel - Pierwszy na świecie Open source\\''owy panel kontrolny seo</h1>  \r\n        <p> \r\n            <b>Złóż donację</b> dla Seo Panel aby wesprzeć pierwszy na świecie open source\\''owy panel kontrolny seo. \r\n            Planujemy <b>zwiększać i ulepszać</b> funkcjonalość Seo Panel w przyszłości.  \r\n            <br>Tylko z Twoim <b>wsparciem</b> możemy osiągnąć nasz <b>cel</b>. \r\n            Jeżeli uważasz że Seo Panel jest dla Ciebie <b>cenny</b>, prosimy o donację jakiejkolwiek kwoty dla Seo Panel. \r\n            <br>W zamian <b>opublikujemy</b> Twoje Nazwisko i adres twojej strony na <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">stronie donacji</a>, jak tylko otrzymamy donację. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Otwórz tą linkę i złóż donację dla Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2010-10-24 23:38:20'),
