(1405, 'pl', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Witamy w Seo Panel - pierwszym na świecie panelu kontrolnym dla wielu Stron</h1> \r\n        <p> \r\n           Kompletne źródło <b> Seo Panel</b> do zarządzania <b>Optymalizacją dla Wyszukiwarek (Search Engine Optimization)</b> twoich Stron.  \r\n            Seo Panel jest to zbiór <b>Narzędzi Seo</b> włączając najnowsze narzędzia aby <b>zwiększyć kontrolę i wydajność</b> twoich Stron. \r\n            Jest to <b>darmowe narzędzie</b> rozpowszechniane na licencji <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            Główną funkcją Seo Panel jest <b>rozszerzalność</b> o nowe <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">pluginy Seo</a>. \r\n            Każdy może łatwo <b>tworzyć i instalować</b> pluginy do swojego Seo Panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Jest to Open source\\''owe oprogramowanie <b>wydane w Styczniu 2010</b>. \r\n            W tym <b>krótkim okresie</b> czasu <b>tysiąc</b> of <b>web masterów</b> używają ten software do <b>optymalizowania</b> swoich Stron. \r\n            Uzyj Seo Panel dzisiaj i <b>ciesz</b> się pełną kontrolą Seo w jednym narzędziu</b>. \r\n        </p>', '2010-10-09 02:41:25'),
(1406, 'pl', 'home', 'home_cont2', '<fieldset> \r\n<legend>Główne fukcje Seo Panel <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Narzędzie to automatycznej submisji Stron do Katalogów</h1> \r\n        <p> \r\n            Narzędzie to automatycznej submisji Stron do Katalogów pomaga nam  help us to <b>submitować Strony</b> do największych<b> darmowych i płatnych Katalogów</b>. \r\n            Możemy również <b>śledzić status</b> każdej submisji przez <b>okresowe sprawdzania statusów</b>. \r\n            <b>Manadżer Katalogów</b> pomoże nam sprawdzić czy dany <b>katalog jest aktywny</b> czy nie. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzenie pozycji keyword\\''ów</h1> \r\n        <p> \r\n            Sprawdzenie pozycji keyword\\''ów  pozwoli znaleźć <b>pozycję w wyszukiwarkach</b> dla <b>zdefiniowanych Keyword\\''ów</b> dla twojej Strony. \r\n           W raportach możemy zobaczyć <b>dzienne pozycje</b> Keyword\\''ów w różnych wyszukiwarkach, <b>piękne wykresy</b> i <b>raport z detalami</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Site Auditor</h1> \r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. Pomoże nam generować mapy Strony <b>XML,HTML,TEXT</b> w formie plików gotowe do <b>submitowania</b> do wyszukiwarek.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzanie Google Rank i Alexa Rank</h1> \r\n        <p> \r\n            Sprawdzanie Google Rank i Alexa Rank znajdzie <b>google pagerank</b> i <b>alexa rank</b> naszych stron i <b>zapisze</b> je w systemie. \r\n            W sekcji <b>Raport rankingów</b>, możemy zobaczyć <b>dzienne</b> rankingi google i alexa rank każdej Strony w <b>szczegółowym raporcie</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzanie backlinków</h1> \r\n        <p> \r\n            Sprawdzanie backlinków znajdzie <b>liczbę backlinków</b> w różnych wyszukiwarkach <b>(google,yahoo,msn itd.)</b> i <b>zapisuje</b> je w systemie. \r\n            <br>W sekcji <b>Sprawdzanie backlinków</b>, możemy zobaczyć <b>dzienne raporty</b> ze sprawdzania backlinkow każdej Strony <b>ze szczegółami</b>.\r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Sprawdzanie Nasycenia w Wyszukiwarkach</h1> \r\n        <p> \r\n            Sprawdzanie Nasycenia w Wyszukiwarkach znajdzie <b>liczbę zaindexowanych podstron</b> naszych Stron w różnych wyszukiwarkach <b>(google,yahoo,msn etc)</b> i <b>zapisze</b> je w systemie. \r\n            W sekcji <b>raport nasycenia w wyszukiwarkach</b> możemy zobaczyć <b>dzienną liczbę zaindeksowanych podstron</b> i <b>szczegółowy raport</b> o każdej Stronie. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Pluginy Seo Panel</h1> \r\n        <p> \r\n            <b>Główną funkcjonalnością</b> Seo Panel jest <b>rozszerzalność</b>. \r\n            Dodaj <b>pluginy Seo</b> do twojego Seo Panel aby <b>rozszerzyć funkcjonalność</b> według twoich potrzeb.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Pluginy Seo Panel</a> są dostarczane przez Seo Panel oraz źródła zewnętrzne. \r\n            Możesz łatwo <b>tworzyć</b> pluginy Seo dla swojego Seo Panel. \r\n            możesz <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submitować</a> twoje pluginy do Seo Panel a my je <b>opublikujemy</b> na naszej stronie po uprzednim <b>sprawdzeniu</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Generator tagów Meta</h1> \r\n        <p> \r\n            Generator tagów Meta jest także <b>pluginem Seo</b> do generowania <b>własnych tagów Metas</b> na naszą Stronę. \r\n           Pomoże nam to dać <b>więcej informacji</b> o naszej Stronie dla <b>robotów wyszukiwarek</b>\r\npodczas indeksowanie Strony. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2010-10-09 02:41:25'),
(1407, 'pl', 'home', 'home_cont3', '<fieldset> \r\n<legend>Zasoby online dla Seo Panel</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Zasoby online dla Seo Panel dla szybkiej referencji</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Oficjalna strona Seo Panel</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Sciągnij Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demo Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Skontaktuj się z Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Pomoc Użytkownika Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Forum Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">System Wsparcia Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Złóż donację dla Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2010-10-09 02:41:25');
