(1613, 'hu', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Üdvözöllek a Seo Panelben - A világ első nyílt forráskódú Seo Segédjében</h1> \r\n<p> \r\nEz egy teljesen <b>ingyenes</b> eszköz, mely nagy mértékben megkönnyíti a <b>keresőoptimalizálást</b>. Egyszerre több népszerű Seo eszközt foglal magában, hogy weblapjából a maximumot hozhassa ki. Nyílt forráskódú (GNU GENERAL PUBLIC LICENSE) ezért Ön is fejleszthet hozzá különböző kiegészítőket.\r\nLegfőbb tulajdonsága a <b>bővíthetőség</b>, mivel könnyedén bővíteni lehet <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo kiegészítőkkel</a>. \r\n</p>\r\n <p></p>\r\n <p> Ez az ingyenes software <b>2010 Januárjában</b> lett közzétéve. Azóta több <b>ezer</b> <b>webmester</b> használja világszerte.\r\n</p>', '2011-07-10 23:51:07'),
(1614, 'hu', 'home', 'home_cont2', '<fieldset>\r\n<legend>A Seo Panel legfőbb Tulajdonságai <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatikus linkbeküldés katalógusokba</h1>\r\n        <p>\r\n            Az automatikus linkbeküldő eszköz segít Önnek, hogy <b>weboldalai</b> bekerüljenek a legnagyobb <b>ingyenes és fizetős katalógusokba.</b>\r\n            A beküldés után az <b>állapotellenőrző scripttel</b> <b>ellenőrizheti</b> minden egyes katalógusban <b>linkjei állapotát</b>.\r\n          Ezen felül a <b>Katalógusrendező</b> segít Önnek, hogy mely <b> katalógusok működnek</b> és melyek azok amik már nem.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Kulcsszó helyezés Viszgáló</h1>\r\n        <p>\r\n            A <b>kulcsszó helyezés</b> vizsgáló segítségével ellenőrizheti, hogy az Ön által <b>választott kulcsszavak</b> milyen helyen szerepelnek a keresők <b>találati listáján</b>.\r\n            A Helyezésekről <b>részletes</b>, grafikus jelentéseket készíthet, ahol megtekintheti kulcsszavainak <b>napi pozícióját</b> a különböző keresők találati listáján.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Site Auditor</h1>\r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. A Seo Panel segítségével különböző formátumú(<b>XML,HTML,TEXT</b>) oldaltérképet készíthet, amit később <b>beküldhet</b> a keresőknek.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google and Alexa Rang Ellenőrző</h1>\r\n        <p>\r\n            A Google és Alexa rang ellenőrző segítségével megtudhatja oldalának <b>Pagerank</b>-ját, valamint az <b>Alexa pozícióját</b>. A kapott adatokat <b>eltárolhatja</b>.\r\n          A tárolt adatokról <b>jelentéseket</b> készíthet, amiben weboldalainak napi Pagerankja és Alexa pozíciója lesz látható.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Ellenőrző</h1>\r\n        <p>\r\n            A Backlink ellenőrzővel megtudhatja, hogy a különböző keresők<b>(google,yahoo,msn etc)</b> <b>mennyi linket</b> látnak amik az Ön oldalára mutatnak. A kapott adatokat <b>eltárolhatja</b>.\r\n                      <br> A tárolt adatokról <b>jelentéseket</b> készíthet, amiben weboldalainak backlinjeinek számát láthatja napi lebontásban.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Indexelt oldalak</h1>\r\n        <p>\r\n            Az Indexelt oldalak vizsgálatával kiderül, hogy a különböző keresőkben<b>(google,yahoo,msn stb..)</b> mennyi <br>indexelt oldala</br> van a weblapjának. A kapott adatokat <b>eltárolhatja</b>.\r\n\r\n              A tárolt adatokról <b>jelentéseket</b> készíthet, amiben az <br>indexelt oldalak</br> számát napi nézetben láthatja.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Kiegészítők</h1>\r\n        <p>\r\n            A legfőbb <b>tulajdonsága</b>  a Seo Panel-nek a <b>bővíthetőség</b>. További kiegészítőket itt tud letölteni: <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel kiegészítők</a>.\r\n           \r\n            \r\n            Könnyedén <b>fejleszthet</b> Ön is Seo Kiegészítőket a Seo Panelhez.\r\n            Az Ön által fejlesztett kiegészítőket <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">beküldheti</a> a Seo Panel oldalára, ahol egy rövid áttekintés után <b>megjelenik</b> a többi kiegészítő között.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Generátor</h1>\r\n        <p>\r\n            A meta tag generátor egy <b>Seo panel kiegészítő</b> amivel <b>egyedi meta tagokat</b> készíthet weboldalai számára.\r\n        \r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-10 23:51:07'),
(1615, 'hu', 'home', 'home_cont3', '<fieldset>\r\n<legend>További információk a Seo Panelről</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel a neten</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Hivatalos Oldala</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Seo Panel Letöltése</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demó</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kapcsolat</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Kézikönyv</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Fórum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Segítségnyújtás</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel Támogatása</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-10 23:51:07'),
