(1902, 'nl', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Welkom bij Seo Panel - \\''s Werelds eerste Seo bedieningspaneel voor meerdere Websites</h1>\r\n        <p>\r\n            Een compleet <b>Open Source Seo bedieningspaneel</b> voor <b>zoekmachine optimalisering</b> van uw websites.\r\n           Seo Panel is in feite een <b>Seo Tool Kit</b> met de belangrijkste functies om de <b>zoekmachine optimalisering</b> van uw websites te\r\n<b>observeren en te verbeteren</b>.\r\n            Dit is <b>Gratis Software</b> vrijgegeven onder de <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            De kracht van Seo Panel ligt in de <b>uitbreidingsmogelijkheden</b>; door gebruik te maken van de <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">Seo Plugins</a>.\r\n            Iedereen kan eenvoudig nieuwe <b>plugins ontwikkelen en installeren</b> voor Seo Panel.\r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Deze Open Source software werd <b>januari 2010 uitgegeven</b>.\r\n			In een <b>korte periode</b> zijn er <b>duizenden webmasters</b> die deze software gebruiken om hun websites te <b>optimaliseren</b>. \r\n			Probeer Seo Panel zelf en <b>maak kennis</b> met het platform en alle seo gerelateerde functionaliteit.\r\n        </p>', '2011-07-05 14:52:28'),
(1903, 'nl', 'home', 'home_cont2', '<fieldset>\r\n<legend>Hoofd functionaliteiten van Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatische Directory Inschrijving Tool</h1>\r\n		<p>\r\n			De automatische directory inschrijving tool geeft <b>toegang naar veel gratis en betaalde web-directories</b>. Daarnaast kan de <b>status van elke inschrijving periodiek worden gecontroleerd</b>; met behulp van het <b>Controleer Status Inschrijving script</b>. De <b>Directory Manager</b> helpt aan te tonen in<b>welke directory uw domein actief is en welke niet</b>.\r\n			\r\n		</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Posities van Zoekwoorden</h1>\r\n		<p>\r\n			U kunt de <b>zoekmachine posities</b> van <b>de betreffende zoekwoorden</b> die u heeft toegewezen aan de websites <b>opslaan</b> in het systeem.\r\n			Zo kunt u de <b>dagelijkse posities</b> van zoekwoorden van verschillende zoekmachines <b>gedetailleerd</b> en in <b>grafieken</b> weergeven.			\r\n		</p>\r\n    </li>\r\n    <li>         \r\n        <h1>Site Auditor</h1> \r\n        <p>Site Auditor zal <b>alle SEO factoren controleren</b> van iedere pagina van een site en geeft een \r\n<b>gedetailleerd rapport</b> over iedere pagina. Dit helpt ons om <b>XML,HTML,TEXT</b> sitemap bestanden van de website om <b>toe te voegen</b> aan zoekmachines.</p> \r\n    </li> \r\n    <li>        \r\n    <li>        \r\n        <h1>Sitemap Generator</h1>\r\n		<p>Genereert <b>XML,HTML,TEXT</b> sitemap bestanden voor alle websites. Vervolgens kunt u de bestanden aanbieden aan de zoekmachines.\r\n    </li>\r\n    <li>        \r\n        <h1>Google en Alexa Rank Controle</h1>\r\n		<p>\r\n		Met deze functionaliteit controleert u de <b>Google Pagerank</b> en <b>Alexa Rank</b> van de websites en slaat de gegevens op in het systeem.\r\n		In de <b>Rank Controle</b> sectie, kunnen we dagelijks de <b>Google en Alexa Rank</b> van elke website zien met <b>gedetailleerde informatie</b>.\r\n		</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Controle</h1>\r\n		<p>\r\n		De Backlink Controle vindt het <b>aantal Backlinks</b> naar de website in de verschillende zoekmachines <b>(google,yahoo,msn etc)</b> en slaat de gegevens op in het systeem.\r\n			<br>\r\n			In de <b>backlink Rapporten</b> sectie, kunnen we de <b>dagelijkse</b> backlink tellingen zien van elke website met <b>gedetailleerde informatie</b>.\r\n		</p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Zoekmachine Verzadiging Controle</h1>\r\n		<p>\r\n		Zoekmachine Verzadiging Controle vindt het <b>aantal geïndexeerde pagina\\''s</b> van de websites in de verschillende zoekmachines <b>(Google, Yahoo, MSN enz)</b> en slaat deze op in het systeem. In de <b>Zoekmachine Verzadiging Controle rapporten</b> sectie, kunnen we de <b>dagelijks</b> geïndexeerde pagina tellingen terugvinden van elke website met <b>gedetailleerde informatie</b>.\r\n			</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Plugins</h1>\r\n        <p>\r\n		Het <b>belangrijkste kenmerk</b> van Seo Panel is de <b>uitbreidingsmogelijkheid</b>. Voeg <b>Seo plugins</b> toe om uw Seo panel <b>functies uit te breiden</b> volgens uw behoefte. <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> worden geleverd door zowel Seo panel en sites van derden. U kunt zelf ook makkelijk Seo plugins <b>ontwikkelen</b> voor Seo Panel. U kunt uw Seo plugin <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">doorsturen naar Seo Panel</a>. Na deze <b>getest</b> te hebben zullen wij deze vervolgens op de Seo Panel website plubliceren!\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Generator</h1>\r\n		<p>\r\n		Meta Tag generator is een <b>Seo Panel Plugin</b> voor het maken van aangepaste <b>Meta Tags</b> voor uw websites. Het helpt u om <b>meer informatie</b> over uw website te geven aan de <b>spiderbots van de zoekmachines</b> terwijl zij de website doorlopen.\r\n		\r\n		</p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-05 14:52:28'),
(1904, 'nl', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel Online Hulpbronnen</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel Online Hulpbronnen ter Referentie</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Officiële Seo Panel Website</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Seo Panel Downloaden</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Seo Panel Contact</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Helpdesk</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Support Systeem</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel Donatie</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-05 14:52:28'),
