(2524, 'ru', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Добро пожаловать на сайт Seo Panel - первый в мире бесплатный инструмент для продвижения сайтов</h1>\r\n        <p>\r\n            Seo panel - <b>скрипт с открытым исходным кодом</b>, для управления <b>оптимизацией сайтов</b> для поисковых систем. \r\n            Seo Panel это <b>набор инструментов для сео,</b> включающий в себя инструменты для \r\n<b>отслеживания и увеличения</b> <b>позиций</b> ваших сайтов в поисковых системах.\r\n            Seo panel <b>бесплатное программное обеспечение,</b> выпущенное под лицензией <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n            Главной особенностью Seo panel, является ее <b>настраиваемость</b>, с помощью <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">сео плагинов</a>.\r\n            Любой разработчик может легко <b>разработать и установить</b> необходимые плагины для Seo panel.\r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Seo panel - открытое программное обеспечение, <b>выпущено в январе 2010 года</b>.\r\n            За этот <b>короткий период</b> времени, <b>тысячи</b> <b>веб-мастеров</b> начали использовать программу для <b>оптимизации</b> своих сайтов.\r\n            Используйте Seo panel сегодня вместе с нами, для <b>успешного</b> <b>продвижения сайтов в поисковых системах, применяя единую платформу</b>.\r\n        </p>', '2011-07-13 02:05:21'),
(2525, 'ru', 'home', 'home_cont2', '<fieldset>\r\n<legend>Основные характеристики Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Инструмент автоматический рассылки в каталоги</h1>\r\n        <p>\r\n            Инструмент автоматический рассылки в каталоги поможет вам <b>рассылать ваши сайты</b> во многие <b>бесплатные\r\nи платные каталоги</b>.\r\n            А так же скрипт рассылки <b>отслеживает состояние</b> каждой отправленной ссылки <b>через периодические проверки</b> с помощью\r\n  программы <b>проверки статуса отправки</b>.\r\n            <b>Менеджер каталогов</b> поможет вам узнать, <b>активный каталог</b> или нет.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Проверка позиции ключевых слов</h1>\r\n        <p>\r\n            Поиск позиции ключевых слов в <b>поисковых системах</b> по <b>целевым ключевым словам</b>\r\nсайта и <b>сохранение их в</b> системе.\r\n            В разделе отчетов о положении ключевых слов, вы можете увидеть <b>ежедневные позиции</b> ключевых слов в \r\nразличных поисковых системах в виде <b>красивой графики</b> и <b>подробных отчетов</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Аудит сайта</h1>\r\n        <p>Аудитор сайта будет проводить <b> сео-проверку всех факторов</b> каждой страницы сайта и предоставит\r\n<b>подробный отчет</b> о каждой странице. Это поможет вам создавать <b>XML,HTML,TEXT</b> файлы карты сайта\r\n с для <b>отправки</b> в поисковые системы.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Проверка рейтинга Google и Alexa Rank</h1>\r\n        <p>\r\n            Отслеживание Google и Alexa Rank, <b>google pagerank</b> и <b>alexa rank</b> ваших\r\nсайтов и <b>сохранение</b> их в системе.\r\n            В разделе <b>отчеты по рейтингу</b>, вы увидите <b>ежедневные детальные отчеты</b> google и alexa rank каждого добавленного вами сайта.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Проверка обратных ссылок</h1>\r\n        <p>\r\n            Проверка обратных ссылок даст <b>количество отчет о количестве ссылок</b> на ваши сайты в различных поисковых\r\nсистемах<b> (yandex, google, yahoo, msn и т.д.)</b>, сохранит отчет в системе.\r\n            <br>В <b>ежедневных отчетах</b> вы увидите подробно статистику <b>о обратных ссылках</b> на ваши сайты.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Проверка поисковой насыщенности</h1>\r\n        <p>\r\n            Проверка поисковой насыщенности покажет <b>количество проиндексированных страниц</b> вашего сайта или магазина в\r\nразличных поисковых системах<b> (yandex, google, yahoo, msn и т.д.)</b>.\r\n            В разделе <b>отчеты о проверке поисковой насыщенности</b>, вы можете увидеть <b>подсчет ежедневно проиндексированных\r\nстраниц</b> каждого добавленного сайта <b>в виде детального отчета</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Плагины Seo Panel</h1>\r\n        <p>\r\n           Главной особенностью <b>Seo Panel</b> является его <b>расширяемость</b>.\r\n            Добавьте <b>seo плагины</b> в вашу Seo panel для <b>расширения ее возможностей</b> в соответствии с вашим\r\nтребованиями.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Плагины Seo panel</a>, предоставляются как разработчиками системы\r\nтак и сторонними разработчиками.\r\n            И вы можно легко <b>разрабатывать</b> сео плагины для Seo panel.\r\n            Вы можете <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">отпрваить</a> ваши seo плагины для Seo panel нам, \r\nмы обязательно <b>опубликуем</b> после рассмотрения на нашем сайте ваши <b>плагины</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Генератор мета-тегов</h1>\r\n        <p>\r\n            Генератор мета-тегов это <b>плагин Seo panel</b> для создания <b>мета-тегов сайта</b> пользователей.\r\n            Генератор мета-тегов позволит вам дать <b>более подробную информацию</b> о вашем сайте <b>ботам поисковых систем</b>\r\nво время индексации вашего сайта.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-13 02:05:21'),
