(2534, 'zh', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">欢迎来到 Seo Panel - 全球第一款支\r\n\r\n持多站点的开源SEO工具</h1> \r\n        <p> \r\n            一个完整的 <b>开源seo 控制面板</b> 来控制你的站点<b>操作</b> .  \r\n            Seo Panel 是一个拥有最前沿热门的seo工具 <b>增加和追踪</b> 你的站点表现的\r\n<b>SEO工具包</b>. \r\n            它是一个<b>免费的软件</b> 在遵循<b>GNU GENERAL PUBLIC LICENSE</b>协议下发布. \r\n            seopanel主要的功能是 <b>扩展性</b> 通过使用 <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo 插件</a>. \r\n            任何人都可以简单 <b>开发和安装</b> 各自需要的插件.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            这款开源软件发布自<b>2010年1月</b>. \r\n            在这么<b>少的</b>时间 <b>上千</b><b>站长</b> 在用此软件 <b>操作</b> 他们的站点. \r\n            现在您可以在<b>同一个平台下</b>使用和<b>享受</b> seo的任何东西. \r\n        </p>\r\n', '2011-07-05 23:02:25'),
(2535, 'zh', 'home', 'home_cont2', '<fieldset> \r\n<legend> Seo Panel主要功能 <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>自动目录提交工具</h1> \r\n        <p> \r\n            自动目录提交工具帮助我们<b>提交我们的站点</b>进入主要<b>免费和付费internet目录</b>. \r\n            我们也可以每次使用<b>状态检查脚本</b>提交<b>定期检查</b><b>追踪状态</b>. \r\n            <b>目录管理器</b>会帮助我们找出<b>目录是否激活</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>关键字位置查询器</h1> \r\n        <p> \r\n           关键字位置查询器会系统中找出你的站点的<b>目标关键字</b>在<b>搜索引擎的排名位置</b> \r\n并且 <b>存储排名数据</b> . \r\n            在关键字报告区域, 我们可以通过<b>简洁的图表</b>和<b>详细报告</b>看到<b>每日</b>关键字在不\r\n\r\n同的搜索引擎排名的报告. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>站点审计器</h1> \r\n        <p>站点审计器可以 <b>审计所有的SEO要素</b> 在一个网站上的所有页面并且生成\r\n<b>详细报告t</b> 定位每一张网页. 这将会有助于创建我们的 <b>XML,HTML,TEXT</b>站点地图文件来<b>提交</b> 给\r\n\r\n搜索引擎.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Google和Alexa排名查询器</h1> \r\n        <p> \r\n            Google和Alexa排名查询器 会查询<b>Google PageRank</b> 和 <b>Alexa排名</b> 我们的站点并 <b>\r\n\r\n存储</b>在系统中. \r\n            在<b>排名报告</b> 中, 我们可以看到<b>每天</b>每个Google PR和 Alexa排名<b>详细报告</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>反向链接查询器</h1> \r\n        <p> \r\n            反向链接查询器会在不同的搜索引擎中<b>(google,yahoo,msn 等)</b>找出>我们的站点的<b>反向链\r\n\r\n接数量</b>并<b>存储</b>到系统中. \r\n            <br>在<b>反向链接报告</b> 中, 我们可以通过<b>详细报告</b>看到每个站点的<b>每天反向链接数\r\n\r\n量</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>搜索引擎收录量查询器</h1> \r\n        <p> \r\n            搜索引擎收录量查询器会查询>我们的站点在不同的搜索引擎<b>(google,yahoo,msn 等)的<b>数量页\r\n\r\n面排名</b</b>并<b>存储</b>到系统中. \r\n            在 <b>搜索引擎收录量查询报告</b> 中, 我们可以通过<b>详细报告</b>看到每个站点的<b>每天的页\r\n\r\n面收录数量\r\n</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Seo Panel 插件</h1> \r\n        <p> \r\n            SEO控制面板的<b>主要功能</b>是它的<b>扩展性</b>. \r\n            根据你的需求增到<b>seo插件</b>到你的seo panel<b>扩展功能</b>. \r\n            <a href=\\"<?=SP_插件ITE?>\\" target=\\"_blank\\">Seo panel 插件</a>由seopanel\r\n和第三方站点提供. \r\n            你可以为你的seo panel简单<b>开发</b> seo插件. \r\n            你可以在<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submit</a>发布你的seo插件seo panel，\r\n\r\n在我们通过 <b>审查</b> 处理之后就会<b>公布</b> 在我们的站点. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Meta标签生成器</h1> \r\n        <p> \r\n            Meta标签生成器是一个为我们的站点创建 <b>自定义Mta标签</b>的<b>seo panel 插件</b>. \r\n            它帮助<b>搜索引擎机器人</b>\r\n爬行我们站点的时候获得关于我们的站点<b>更多信息</b>  . \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-07-05 23:02:25'),
(2536, 'zh', 'home', 'home_cont3', '<fieldset> \r\n<legend>Seo Panel 在线资源</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Seo Panel 在线资源信息</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel 官方站点</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">下载Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel 例子</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">联系Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel 帮助向导</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel 论坛</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel 支持系统</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐赠 Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2011-07-05 23:02:25'),
