(2685, 'ru', 'support', 'support_cont1', '<fieldset>\r\n<legend>Служба поддержки Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Пакет из 1000 каталогов.</h1> \r\n        <p>\r\n            Мы представляем пакет из <b>1000 качественных бесплатных и проверенных</b> интернет-каталогов, для добавления\r\nв вашу seo panel.\r\n            Рассылка поможет вам <b>увеличить количество обратных ссылок</b> на ваш сайт.\r\n            На самом деле список из 1000 каталогов <b>введен</b> для сбора денег на <b>будущее\r\nразвитие</b> seo panel.\r\n            Чтобы получить список из 1000 каталогов, пожалуйста <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">пожертвуйте</a>\r\n$10 или больше, для улучшения Seo panel.\r\n            Если у вас возникли вопросы связанные с пакетом из 1000 каталогов, пожалуйста,<a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">свяжитесь с нами</a> или откройте запрос в <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">службе поддержки</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Нажмите на ссылку для пожертвования на развитие</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Локальный пакет поисковых систем</h1> \r\n        <p>\r\n            Добавить <b>домены локальных поисковых систем</b> google,yahoo,msn(<b>например: www.google.de,www.google.fr\r\nи т.д.</b>) в seo panel, <b>для проверки позиций в поисковых системах</b>, отслеживания производительности вашего сайта \r\nв вашей стране или регионе.\r\n            Для того чтобы получить информацию о добавлении локальных поисковых системах (согласно вашему требованию), пожалуйста, <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">пожертвуйте</a> $10 или больше, для улучшения сео-панели.\r\n            Перед отправкой пожертвования, пожалуйста, <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">свяжитесь с нами,</a> мы отправим\r\nвам список необходимых доменов поисковых систем.\r\n            <br><br>              \r\n            Кроме того, чтобы добавить <b>новые поисковые системы (например:yandex.ru)</b> в вашу Seo panel для проверки ключевых слов,\r\nпожалуйста <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">свяжитесь с нами</a> или откройте запрос <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">в службе поддержки</a>. \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Пройдите по ссылке, чтобы связаться с нами</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Плагины Seo Panel</h1> \r\n        <p>\r\n            Добавить <b>сео-плагины</b> в вашу seo panel для <b>расширения возможностей</b> по вашему требованию.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Плагины Seo panel</a> предоставляются разработчиками Seo panel\r\nи сторонними разработчиками.\r\n            Вы также можете легко <b>разработать</b> сео-плагин для вашего seo panel.\r\n            Вы можете <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">отправить</a> ваш SEO плагин для Seo panel, \r\nмы <b>опубликуем</b> его на нашем сайте после <b>предварительной</b> проверки.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Пройдите по ссылке, для получения сео-плагинов</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Связаться с нами</h1> \r\n        <p>\r\n            Обращайтесь к нам по любым возникшим вопросам по работе с <b>инструментами, плагинами и расширениями seo panel,</b> для\r\nперехода нажмите на ссылку.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Пройдите по ссылке для связи с нами.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Запросы в поддержку</h1> \r\n        <p>\r\n            Для того чтобы получить <b>техническую поддержку</b> по установке seo panel <b>инструментов, плагинов и\r\nрасширений</b>. Например: Настроить крон для проверки позиций ключевых слов.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Пройдите по ссылке в службу технической поддержки</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Отчеты по ошибкам</h1> \r\n        <p>\r\n            Для отправки отчетов по <b>ошибкам</b> в <b>инструментах seo panel, плагинах и расширениях</b> нажмите на ссылку.\r\nПожалуйста, помогите нам улучшить возможности в следующей версии.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Пройдите по ссылке для сообщения об ошибке.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2011-07-13 11:24:27'),
(2686, 'ru', 'support', 'support_cont2', '<fieldset>\r\n<legend>Онлайн ресурсы Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Руководство Seo Panel</h1> \r\n        <p>\r\n            Вы можете посмотреть <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">документацию seo panel</a> в разделе\r\n<b>руководство</b>, которая содержит <b>документацию</b> по использованию инструментов seo panel, плагинов и расширений.\r\n			<br>Это лучшее место в интернете для получения <br>справки</br> о SEO панели. Мы надеемся, что вы\r\n<b>поможете</b> seo panel в совершенствовании разработки первого бесплатного инструмента для продвижения сайтов!\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Перейти в раздел помощь</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Форум Seo Panel</h1> \r\n        <p>\r\n            <b>Форум Seo panel</b>, место для обсуждения первого открытого программного продукта для продвижения сайтов. \r\n            Это лучшее место для поиска <b>ответов</b> на <b>ваши вопросы</b> о seo panel. \r\n            <br>Также вы можете <b>внести</b> долю вашего <b>опыта</b> При использовании Seo panel для оптимизации\r\nсайтов.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Перейти на форум Seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2011-07-13 11:24:27'),
(2687, 'ru', 'support', 'support_cont3', '<fieldset>\r\n<legend>Пожертвования на развитие Seo Panel</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Пожертвования на развитие Seo Panel - первой в мире программы для оптимизации сайтов с открытым исходным кодом.</h1> \r\n        <p>\r\n            <b>Поддержите</b> первый в мире скрипт для создания сервиса по продвижению сайтов в интернете.\r\n            Мы планируем в будущем развивать <b>и улучшать </b> программное обеспечение.\r\n            <br>По всем вопросам <b>поддержки</b>, только мы сможем дать правильные <b>ответы</b>.\r\n            Если вы понимаете, что Seo panel <b>стоит</b> вашего внимания, пожалуйста пожертвуйте команде разработчиков.\r\n            <br>Мы <b>опубликуем</b> ваше имя на нашем сайте и ссылку на ваши ресурсы <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">на странице пожертований</a>, после получения пожертвования.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Перейти на страницу пожертвования seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>\r\n', '2011-07-13 11:24:27'),
