(3146, 'pt', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bem-vindo ao Seo Painel - ao primeiro painel de controle seo para vários sites do mundo</h1>\r\n<p>\r\nUm completo <b>  Seo Panel de controle, software livre </b> para gerenciar <b> a optimização do motor de busca </b> dos seus sites.\r\nSeo Panel é um <b> kit de ferramentas </b> que inclui as mais recentes ferramentas de SEO para <b> aumentar e controlar </b>\r\n<b> performace </B> dos seus sites.\r\nÉ um software livre <b> </b> lançado em <b>  GNU LICENÇA PÚBLICA GERAL </b>.\r\nA principal característica do painel de seo é a sua extensibilidade <b> </b> usando <a href = \\"<?=SP_PLUGINSITE?>\\" target = \\"_blank\\"> seo plugins </a>.\r\nQualquer um pode facilmente <b> desenvolver e instalar </b>  plugins necessários para seu painel de seo.\r\n</P>\r\n</p>\r\n<p>\r\nEste software de código aberto foi <b> lançado em janeiro de 2010 </b>.\r\nCom <b> neste curto período </b> de tempo milhares de <b> webmasters </b> estão usando este software para optimização dos seus sites.\r\nUtilize o painel de SEO hoje  <b>e desfrute </b> tudo relacionado ao seo sob uma única <b> plataforma </b>.\r\n</P> ', '2011-07-10 02:41:24'),
(3147, 'pt', 'home', 'home_cont2', '<fieldset>\r\n<legend> Principais Características do Seo Panel <?=SP_INSTALLED?> </legend>\r\n<ul class=\\"infobox\\">\r\n<li>\r\n<h1>Ferramenta de Envio automático Diretório </h1>\r\n<p>\r\nFerramenta automática da submissão do directório para nos ajudar<b> a apresentar os nossos sites </b> nos maiores <b> , grandes\r\ne pagos directórios da Internet </b>.\r\nNós também podemos <b> acompanhar o status </b> de cada submissão através <b> de uma verificação periódica </b> usando o \r\nstatus <b> submissão de script </b>.\r\n<b> gerenciando o Directório </b> irá nos ajudar a descobrir se está ativo diretório <b> </b> ou não.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Posição Palavra Checker </h1>\r\n<p>\r\nPalavra verificador posição encontra-se o <b> posição do motor de pesquisa </b> de <b> palavras-chave específicas </b>\r\ndo seu site e lojas <b> </b>-lo no sistema.\r\nNa seção de palavra-chave relatórios de posição, podemos ver o <b> posições diárias </b> de palavras-chave\r\ndiferentes motores de busca, <b> belos gráficos </b> e <b> relatórios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Site Auditor </h1>\r\n<p> Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page.  Isso ajudará a criar <b> XML, HTML, TEXTO </b> arquivos sitemap do nosso site para apresentar aos motores de busca. </p>\r\n</Li>\r\n<li>\r\n<h1> Google e Alexa Rank Checker </h1>\r\n<p>\r\nGoogle e verificador alexa rank vai encontrar <b> google pagerank </b>e <b> alexa rank </b> da nossos<b> sites e lojas </b> no sistema.\r\nEm <b> relatórios Rank </b>, podemos ver o <b> rank diário da </b> Google e Alexa rank de cada website por <b> relatórios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Backlinks Checker </h1>\r\n<p>\r\nverificador Backlinks encontrará <b> número de backlinks </b> dos nossos sites em busca diferentes\r\nmotores <b>(Yahoo, google, msn, etc) </b> e lojas <b> </b>-lo no sistema.\r\n<br> Em <b> relatórios backlink </b>, podemos ver os backlinks <b> contagem diária </b> de cada\r\nsite por <b> relatórios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Saturação Search Engine Checker </h1>\r\n<p>\r\nSearch Engine verificador Saturação encontrará <b> número de páginas indexadas </b> dos nossos sites em diferentes<b> motores de busca (google, yahoo, MSN etc) </b> e lojas <b> </b>-lo no sistema.\r\nEm <b> motor de busca de saturação verificador relatórios </b>, podemos ver a página <b> diários indexados\r\nContagem </b> de cada site por <b> relatórios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1>Seo plugins </h1>\r\n<p>\r\nA característica principal <b> </b> do painel de controle é o seu seo extentability <b> </b>.\r\nAdicionar seo <b> plugins </b> ao seu painel de seo para <b> estender os recursos </b> De acordo com o seu\r\nexigência.\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Painel Seo plugins </a> são fornecidos por ambas painel seo\r\ne terceiro locais do partido.\r\nVocê também pode facilmente desenvolver <b> </b> plugins de SEO para seu painel de seo.\r\nVocê pode <a href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> apresentar </a> o seu plugin para seo seo painel e\r\nvamos publicar <b> </B> em nosso site depois da nossa <revisão <b> processo </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Meta Tag Generator </h1>\r\n<p>\r\nMeta tag é um gerador de painel seo <b> plugin </b> para criar <b> personalizado meta tags </b> para o nosso\r\nsite.\r\nIsso nos ajudará a dar mais informações <b> </b> sobre o nosso site para <b> motor de busca robôs </b>\r\nenquanto que rastejam nosso site.\r\n</P>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2011-07-10 02:41:24'),
(3148, 'pt', 'home', 'home_cont3', '<fieldset>\r\n<legend> Recursos on-line do Seo Panel </legend>\r\n<ul class=\\"infobox\\">\r\n\r\n<li>\r\n<h1> Recursos Online de Referência do SEO Panel  </h1>\r\n\r\n\r\n<p>\r\n<a href=\\"http://www.seopanel.in\\" target=\\"_blank\\"> Site Oficial do Seo Panel </a>\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DOWNLOAD_LINK?>\\" Target = \\"_blank\\"> Download Seo Panel </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_DEMO_LINK?>\\" Target = \\"_blank\\"> Seo Panel Demo </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> contactar Seo Panel </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> Guia de Ajuda do Seo Panel  </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_FORUM_LINK?>\\" Target = \\"_blank\\"> Fórum do Seo Panel </a></P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?>\\" Target = \\"_blank\\"> Seo panel sistema de suporte </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?>\\" Target = \\"_blank\\"> Doar para Seo Panel </a>\r\n</P>\r\n</Li>\r\n\r\n</Ul>\r\n</Fieldset> ', '2011-07-10 02:41:24'),
