(3183, 'zh', 'support', 'support_cont1', '<fieldset> \r\n<legend>Seo Panel 帮助系统</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>1000 目录包</h1>  \r\n        <p> \r\n            我们提供<b>超过1000个可用的</b>网络目录包,加到\r\n你的seo panel <b>目录提交工具</b>. \r\n            它会帮助你<b>增加反向链接</b>你的站点. \r\n            在我们获得捐赠后为seo panel<b>以为未来发展</b>,您将获得<b>推荐</b>的1000目录列表，. \r\n            想要获得1000目录列表请<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐赠</a>\r\n$10 或者更多 来改善 seo panel 的功能 . \r\n            如果你有任何问题关于1000目录包,请<a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">联系我们</a>或者打开一个页面 <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">帮助系统</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">访问这个链接捐赠seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>本地搜索引擎包</h1>  \r\n        <p> \r\n            增加<b>本地 搜索引擎 域</b>google,yahoo,msn(<b>例如: www.google.de,www.google.fr\r\netc</b>) seo panel <b>关键字position checker</b>, 追踪你的站点行为本地. \r\n            为了获得本地搜索引擎包(根据你的需求) 请<a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐赠</a> $10或者更多来改善功能seo\r\npanel. \r\n            捐赠之前, 请 <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">联系我们</a> to\r\n提供给我们需要的搜索引擎域名列表. \r\n            <br><br>               \r\n             增加<b>新的搜索引擎(例如:baidu.com)</b>你的 seo panel关键字position checker,\r\n请 <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">联系我们</a>或者打开一个页面在<a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">帮助系统</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">访问这个链接联系我们</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Seo Panel插件</h1>  \r\n        <p> \r\n            增加<b>seo插件</b> 你的seo panel <b>扩展功能</b>根据你的\r\n需求. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel插件</a>由seo panel\r\n和第三方站点提供. \r\n            你可以 easily <b>develop</b> seo插件来你的seo panel. \r\n            你可以<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">提交</a>你的seo plugin seo panel 并且\r\n我们会<b>发布</b>到我们的站点在<b>审查</b>之后.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">访问这个链接为了获得seo panel插件</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>联系我们</h1>  \r\n        <p> \r\n            联系我们来 任何问题 关于 <b>seo panel 工具,插件和功能等等</b> 通过以下链接.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">访问这个链接 联系我们</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>技术支持</h1>  \r\n        <p> \r\n            为了获得 <b>技术支持</b>从seo panel团队设置<b>seo panel工具,插件和\r\n功能</b>. 例如: 设置cron来关键字位置checker. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">访问这个链接创建一个支持ticket</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>报告Bugs</h1>  \r\n        <p> \r\n            报告<b>bugs</b> 关于 <b>seo panel 工具,插件和功能等等</b> 通过以下链接.  \r\n            请 帮助我们在下个版本来改善功能.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">访问这个链接 报告bugs</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2011-05-04 01:56:00'),
(3184, 'zh', 'support', 'support_cont2', '<fieldset> \r\n<legend>Seo Panel 在线资源</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Seo Panel 帮助向导</h1>  \r\n        <p> \r\n            你可以看 <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">seo panel文档</a>在 \r\n<b>帮助向导</b>, 它包括<b>文档</b>来  seo panel 工具,插件和相关的\r\n功能. \r\n            <br>这是在因特网获得关于seo panel帮助的<b>最好的地方</b>.如果你发现错误或者缺少东西,我们希望你seo panel 帮助向导<b>报告</b>.                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">访问seo panel 帮助向导</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Seo Panel论坛</h1>  \r\n        <p> \r\n            一个地方讨论关于世界上第一款开源的<b>seo control panel</b>.  \r\n            这是最好的地方找到<b>答案</b> <b>你的问题</b> 关于 seo panel.  \r\n            <br> 你可以<b>分享</b>你的<b>经验</b> 在使用seo panel来操作你的\r\n站点.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">访问seo panel论坛</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2011-05-04 01:56:00'),
(3185, 'zh', 'support', 'support_cont3', '<fieldset> \r\n<legend>捐赠 Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>捐赠 Seo Panel - 世界上第一款开源的seo control panel</h1>  \r\n        <p> \r\n            <b>捐赠</b> seo panel支持第一款开源的seo control panel世界上. \r\n            我们计划<b>增加和提高</b> 功能 seo panel 的在未来.  \r\n            <br>有了你的<b>支持</b>我们才能达到我们的<b>目标</b>. \r\n            如果你觉得seo panel是<b>值得</b>你拥有, 请捐赠支持seo panel 团队. \r\n            <br>我们<b>会公布</b> 你的名字和站点信息在<a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">捐赠页面</a>, 一旦我们获得捐赠. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">访问这个链接捐赠 seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-05-04 01:56:00'),
