(3211, 'ro', 'support', 'support_cont1', '<fieldset> \r\n<legend>Centrul de suport Seo Panel</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>Pachet 1000 de directoare</h1>  \r\n        <p> \r\n            Va oferim <b>1000 de directoare active si pe deasupra gratis</b> un pachet pe care il puteti adauga in panoul SEO la\r\n <b>sectiunea inregistrare in directoare</b>. \r\n            Va vom ajuta sa <b>va cresteti backlink-urile</b> site-ului dvs. \r\n            Deocamdata lista cu 1000 de directoare <b>mai sus mentionata</b> este pentru colectarea de fonduri <b>pentru desvoltarea viitoare a</b> Seo Panel. \r\n            Pentru a lua lista cu 1000 de directoare va rugam <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donati</a>\r\n$10 sau mai mult pentru a imbunatati caracteristicile pachetului Seo Panel. \r\n            Daca aveti intrebari asupra pachetului de 1000 de directoare, va rugam <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">contactati-ne</a> sau deschideti un tiket la <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">centrul de suport</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a dona pentru Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Pachet motoare de cautare locale</h1>  \r\n        <p> \r\n            Adauga <b>domenii de motoare de cautare locale</b> pentru google,yahoo,msn(<b>eg: www.google.de,www.google.fr, www.google.ro\r\netc</b>) in panoul de control Seo <b>Verificare pozitie cuvinte cheie</b>, pentru a va urmari site-ul personal local. \r\n            Pentru a beneficia de pachetul motarelor de cautare local(in functie de nevoile dvs.) va rugam <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donati</a> $10 sau mai mult pentru a imbunatati caracteristicile pachetului Seo Panel. \r\n           Inainte de a trimite donatii va rugam, <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactati-ne</a> pentru a ne da detalii despre motaorele de cautare locale ale dvs.. \r\n            <br><br>               \r\n            Deasemenea pentru a adauga <b>noi motoare de cautare(eg:baidu.com)</b> la verificare pozitionare cuvinte cheie al Panoului Seo al dvs.,\r\nva rugam <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactati-ne</a> sau deschideti un tiket la <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">centru de suport</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a ne contacta</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Plugin-uri Seo Panel</h1>  \r\n        <p> \r\n            Adauga <b>plugin-uri Seo</b> in panoul de control Seo al dvs. <b>extindeti caracteristicile</b> in functie de necesitatile dvs.. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Plugin-uri Seo Panel</a> sunt dezvoltate atat de Seo Panel cat si de alte site-uri afiliate. \r\n            Puteti deasemenea foarte usor <b>sa dezvoltati</b> plugin-uri seo pentru panoul de control al dvs.\r\n            Puteti <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">uploada</a> plugin-urile dvs in panoul de contro Seo si\r\nnoi le vom <b>publica</b> pe site-ul nostru dupa ce le vom  <b>verifica</b>.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Vizitati acest link pentru a descarca plugin-uri Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Contactati-ne</h1>  \r\n        <p> \r\n            Contactati-ne pentru orice intrebare despre <b>unelte seo panel,plugin-uri si caracteristici etc</b> utilizind link-ul de mai jos.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a ne contacta</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Suport Tickete</h1>  \r\n        <p> \r\n            Pentru a avea <b>suport tehnict</b> din partea echipei Seo Panel pentru a seta <b>uneltele Seo panel, plugin-urile si facilitati\r\n</b>. Ex: Pentru a seta un cron pentru verificare pozitionare cuvinte cheie. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a creea un tiket de suport nou</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Raportai bug-uri</h1>  \r\n        <p> \r\n            rapoortati <b>bug-uri</b> despre<b>unelte seo panel,plugin-uri si caracteristici etc</b> utilizand link-ul de mai jos.  \r\n            va rugam ajutati-ne sa imbunatatim facilitatile din noile versiuni.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru raporta un bug nou </a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2010-11-05 12:42:48'),
(3212, 'ro', 'support', 'support_cont2', '<fieldset> \r\n<legend>Panoul Seo resurse Online</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Ghid ajutor Panoul Seo</h1>  \r\n        <p> \r\n            Puteti vedea <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">documentatia panoului Seo</a> in\r\n<b>Ghidul de ajutor</b>, contine <b>documentatia</b> pentru uneltele panoului seo ,plugin-uri si caracteristici . \r\n            <br>Este cel mai bun loc de pe internet pentru a <b>primi ajutor</b> despre panoul Seo. Speram ca tu vei\r\n<b>contribui</b> la ghidul de ajutor al panoului Seo, daca gasiti erori sau ceva lipsuri.                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Vizitati ghidul de ajutor al panoului Seo</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Forum Seo Panel</h1>  \r\n        <p> \r\n            Un loc pentru discutii despre primul opensource <b>panou de control Seo</b>.  \r\n            Este cel mai bun loc pentru a gasi <b>raspunsuri</b> la <b>intrebarile tale</b> despre panoul Seo.  \r\n            <br>Deasemenea poti <b>imparti</b> <b>experienta</b> ta in timp de utilizezi panoul seo pentru site-urile tale.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Vizitati forumul panoului Seo</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2010-11-05 12:42:48'),
(3213, 'ro', 'support', 'support_cont3', '<fieldset> \r\n<legend>Donati panoului Seo</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Donati panoului seo - Primul Open Source panou de control Seo din lume</h1>  \r\n        <p> \r\n            <b>Donati</b> panoului Seo pentru sustinerea primului panou seo din lume. \r\n            Planuim sa  <b>adaugam si imbunatatim</b> caracteristici ale panoului seo pe viitor.  \r\n            <br>Cu ajutorul <b>suportului</b> dvs. ne putem atinge  <b>telul</b>. \r\n            Daca crezi ca panoul de control seo  <b>conteaza</b> pentru tine, va rugam donati cat vreti echipei Seo Panel. \r\n            <br>Va vom <b>publica</b> numele si informatii despre site-ul dvs in <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">pagina de donatii</a>, de indata ce primim donatia. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a dona Panoului Seo</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2010-11-05 12:42:48'),
(3214, 'ro', 'settings', 'Click here to become a sponsor for Seo Panel', '<b>Donati $100</b> si deveniti <b>sponsor</b> al Seo Panel.', '2011-07-07 02:04:01'),
(3215, 'ro', 'settings', 'seopanel_description', 'Un panou de control complet gratis pentru a controla optimizarea site-urilor dvs. Contine o ultime de unelte noi pentru a creste si verifica performantele site-ului dvs. Este un software open source si deasemenea va puteti dezvolta singuri plugin-urile pentru panoul seo al dvs.', '2011-07-07 02:04:01'),
