(3302, 'hu', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Támogatói Rendszer</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 darabos katalóguscsomag</h1> \r\n        <p>\r\n           Biztosítunk egy <b>1000 darabos ingyenes</b> katalóguscsomagot, melyekbe automatikusan tudja weboldalait beküldeni a <b>linkbeküldő eszközzel</b>.\r\n            Ezzel könnyedén növelheti oldalainak backlink számát <b>oldalainak backlink számát</b>.\r\n            A katalógusok megszerzéséhez kérlek <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">támogasd</a> minimum\r\n$10-al a Seo Panel fejlesztését.\r\n            Ha kérdésed van a csomaggal kapcsolatban kérlek lépj <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">kapcsolatba velünk</a>, vagy kérjen egy jegyet az <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">ügyfélszolgálattól</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">A Seo panel támogatáshoz látogassa meg ezt a linket.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Helyi keresőmotor csomag</h1> \r\n        <p>\r\n            Adjon <b>helyi keresést</b> a google-hoz,yahoo-hoz,msn-hez(például: <b>www.google.de,www.google.fr,www.google.hu\r\nstb..</b>). Így a <b>kulcsszóhelyezés vizsgálóval</b> a lokalizált eredményeket tudja megtekinteni. \r\n            A helyi keresőcsomag megszerzéséhez <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">támogatnia</a> kell minimum $10-al a Seo Panelt.\r\n            Mielőtt elküldené a támogatást, kérem lépjen <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">velünk kapcsolatba</a>, és küldje el nekünk az Ön által kívánt keresőmotor domain kiterjesztését(pl.: .hu, .fr stb..).\r\n            <br><br>              \r\n           Új <b>keresőmotor</b>(pl.:baidu.com) hozzáadásához,\r\nkérem lépjen <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">kapcsolatba velünk</a>, vagy kérjen egy jegyet az <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">ügyfélszolgálattól</a>.  \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Látogassa meg ezt a linket, hogy kapcsolatba léphessen velünk.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Kiegészítők</h1> \r\n        <p>\r\n            Adjon hozzá különböző <b>kiegészítőket</b> Seo paneljéhez, hogy <b>bővíthesse a funkcióit</b>.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel kiegészítőket</a> a Seo panel hivatalos oldala mellett egyéb oldalakon is találhat.\r\n             Könnyedén <b>fejleszthet</b> Ön is Seo Kiegészítőket a Seo Panelhez.\r\n            Az ön által fejlesztett kiegészítőket <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">beküldheti</a> a Seo Panel oldalára ahol egy rövid áttekintés után <b>megjelenik</b> a többi kiegészítő között.       \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Kiegészítők letöltéséhez látogassa meg ezt az oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Kapcsolat</h1> \r\n        <p>\r\n            Ha bármilyen kérdése van(<b>kiegészítők, fejlesztés, stb..</b>), akkor az alábbi linken lépjen velünk kapcsolatba.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Látogassa meg ezt az oldalt a kapcsolatfelvételhez.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Ügyfélszolgálati jegy</h1> \r\n        <p>\r\n          A Seo panel csapat <b>Technikai támogatásért</b>(kiegészítők telepítése, cron beállítása) lépjen kapcsolatba az ügyfélszolgálattal.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Látogassa meg ezt a linket, hogy kapcsolatba léphessen az ügyfélszolgálattal.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Hibák bejelentése</h1> \r\n        <p>\r\n            <b>Hibák</b> bejelentéséhez használja az alábbi linket. Ezzel nagymértékben hozzájárul a program fejlesztéséhez. \r\n                     \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hibabejelentéshez kérem látogassa meg az alábbi oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2010-11-05 19:21:42'),
(3303, 'hu', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Források</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Seo Panel Útmutató</h1> \r\n        <p>\r\n            A <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo panel-hez tartozó dokumentációt</a> az\r\n<b>útmutatóban</b> találja, amely tartalmaz minden olyan információt amely segít a Seo panel használatában.\r\n            <br>Ez a legjobb hely az interneten, hogy <b>segítséget kapj</b> a Seo panellel kapcsolatban. Reméljük, hogy az esetleges elírásokat, hiányosságokat segít nekünk pótolni.               \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel útmutató megtekintése.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Seo Panel Fórum</h1> \r\n        <p>\r\n            Ez az a hely ahol szabadon megoszthatja <b>tapasztalatait</b> a <b>Seo panel</b>-el kapcsolatban. \r\n            Válaszokat találhat a megoldhatatlannak tűnő <b>kérdéseire</b>, továbbá <b>tapasztalatait</b> is megoszthatja másokkal. \r\n                             \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo panel fórumának megtekintése</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2010-11-05 19:21:42'),
(3304, 'hu', 'support', 'support_cont3', '<fieldset>\r\n<legend>Seo panel támogatása</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Támogassa a Seo panelt - amely a világ első nyílt forráskódú Seo segédje.</h1> \r\n        <p>\r\n            <b>Támogassa</b> a Seo panelt - amely a világ első nyílt forráskódú Seo segédje.\r\n            Tervezzük, hogy a jövőben folyamatosan új <b>funkciókat</b> adunk a Seo panelhez, de ehhez az Ön segítségére is szükség van.\r\n           \r\n            Ha úgy érzed, hogy a Seo panel <b>hasznos</b> számodra, akkor kérlek támogasd a fejlesztők csapatát.\r\n            Miután támogattál minket, nevedet és oldalad linkjét <br><b>közzé</b> tesszük a <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">támogatói oldalon</a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">A seo panel támogatásához látogassa meg ezt az oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2010-11-05 19:21:42'),
