(3416, 'bg', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Добре дошли в Seo Panel - Първият в света SEO контролен панел</h1> \r\n        <p> \r\n            SEO контролен панел с <b>напълно отворен код</b>, за управление на <b>оптимизацията за търсещи машини</b> на вашите сайтове.  \r\n            Seo Panel е <b>комплект от SEO инструменти</b>, включващ последните и най-нови инструменти, необходими за <b>повишаване и следене</b> на <b>представянето</b> на вашите уеб сайтове. \r\n            Това е <b>безплатен софтуер</b> разпространяващ се под <b>GNU - GENERAL PUBLIC LICENSE</b>. \r\n            Основаната характеристика на SEO Panel е възможността за <b>разширение на функционалността</b>, чрез използването на <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">SEO модули</a>. \r\n            Всеки може лесно да <b>разработи и инсталира</b> необходимите му модули за неговият SEO panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Този софтуер с отворен код, се разпространява от <b>Януари 2010</b>. \r\n            За този <b>кратък период</b> от време <b>хиляди уеб разработчици</b> използваха този софтуер, за да <b>оптимизират</b>  техните сайтове. \r\n            Изполвайте SEO panel сега и открийте <b>предимствата</b> на работа с много SEO инструменти под една <b>платформа</b>. \r\n        </p> ', '2011-07-06 18:34:28'),
(3417, 'bg', 'home', 'home_cont2', '<fieldset> \r\n<legend>Основни характеристики на Seo Panel <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Инструмент за Автоматично регистриране в Директории</h1> \r\n        <p> \r\n            Инструмента за автоматично регистриране в директории, помага да <b>регистрирате вашите сайтове</b> в голям брой <b>безплатни и платени интернет директории</b>. \r\n            Също така можете да <b>следите статуса</b> на всяка регистрация чрез <b>периодична проверка</b>, използвайки <b>скрипта за следене статуса</b> на регистрация. \r\n            <b>Управлението на директории</b> ви помога да установите дали дадена директория е <b>активна</b> или не. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Инструмент за Проверка на позиция по ключова дума</h1> \r\n        <p> \r\n            Инструмента за проверка на позиция по ключова дума ще открие <b>позицията в търсачка</b> за <b>въведените ключови думи</b>\r\nкъм вашият сайт и ще <b>запази</b> резултата в системата. \r\n            В секцията с доклади за позиция по ключова дума, можете да видите <b>дневните позиции</b> на ключовите думи за различните търсачки чрез <b>графики</b> и <b>детайлни доклади</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Сайт Одитор</h1> \r\n        <p>Сайт Одитора <b>ще направи проверка на всички SEO фактори</b> за страниците на посоченият сайт и ще покаже <b>детайлен доклад</b> за всяка страница. Това ще помогне да се създаде <b>XML,HTML,TEXT</b> карта на сайта, която <b>да се използва</b> за търсещите машини.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Проверка на ранга в Google и Alexa</h1> \r\n        <p> \r\n            Инструмента за проверка на ранга в Google и Alexa, ще ви покаже <b>пейдж ранга в google</b> и <b>ранга в alexa</b> на вашите сайтове и ще го <b>запази</b> в системата. \r\n            В секцията <b>доклади за ранг</b>, можете да видите <b>дневния</b> google и alexa ранг за всеки от въведените сайтове, посредством <b>детайлни доклади</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Инструмент за проверка на беклинкове</h1> \r\n        <p> \r\n            Инструмента за проверка на беклинкове ще провери <b>броя на беклинковете</b> за въведените сайтове в различните търсачки <b>(google,yahoo,msn и т.н.)</b> и <b>ще го запази</b> в системата. \r\n            <br>В секцията <b>Доклади за беклинкове</b>, можете да видите <b>дневното преброяване на беклинковете</b> за всеки от въведените сайтове, посредством <b>детайлни доклади</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Инструмент за проверка на наситеността в търсачка</h1> \r\n        <p> \r\n            Инструмента за проверка на наситеността, ще открие <b>броя индексирани страници</b> за въведените сайтове в различните търсачки <b>(google,yahoo,msn и т.н.)</b> и ще го <b>запази</b> в системата. \r\n            В секцията  <b>Доклади за наситеността</b>, можете да видите <b>броят индексирани страници по дни</b> за всеки от въведните сайтове, посредством <b>детайлни доклади</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Seo Panel Модули</h1> \r\n        <p> \r\n            <b>Основната харектиристика</b> и преимущество на SEO control panel е възможността за <b>разширяване на броя инструменти</b>. \r\n            Добавете <b>SEO модул</b> към вашият SEO panel за да <b>разширите функционалността</b> според вашите нужди. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel модулите</a> се разработват от SEO panel, както и от външни разработчици. \r\n            Можете лесно да <b>разработите</b> SEO модули за вашият SEO panel и да <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">добавите</a> вашият SEO модул към SEO panel, ние ще го <b>публикуваме</b> на нашият сайт, след като го <b>прегледаме</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Генератор на мета тагове</h1> \r\n        <p> \r\n            Генераторът на мета тагове е <b>SEO panel модул</b> за създаване на <b>мета тагове</b> за вашият сайт. \r\n            Мета таговете помагат, да дадете <b>повече информация</b> относно сайта ви на <b>роботите на търсачката</b>, докато те обират информация от сайта ви. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset> ', '2011-07-06 18:34:28'),
(3418, 'bg', 'home', 'home_cont3', '<fieldset> \r\n<legend>Seo Panel - Онлайн ресурси</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Seo Panel - Онлайн ресурси</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel - Официален сайт</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Изтеглете Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Демо</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Контакти</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Помощна информация</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Форум</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Техническа поддръжка</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Направете дарение</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2011-07-06 18:34:28'),
