(3423, 'bg', 'support', 'support_cont1', '<fieldset> \r\n<legend>SEO Panel Техническа подръжка</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>Пакет от 1000 Директории</h1>  \r\n        <p> \r\n            Осигуряваме <b>пакет от 1000 безплатни и потвърдени</b> интернет директории, които можете да добавите към вашият <b>инструмент за регистрация в директории</b> в seo panel. \r\n            Този пакет ще ви помогне <b>да увеличите беклинковете</b> към вашите сайтове. \r\n            Всъщност, списъка с 1000 директории се <b>представя</b> за да съберем средства за <b>бъдеща разработка</b> на seo panel. \r\n            За да получите списъка с 1000 директории, моля <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">направете дарение</a>\r\nот 10 $ или повече. Дарението ще се използва за подобряване на seo panel. \r\n            Ако имате въпроси относно списъка с 1000 директории, моля <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">свържете се с нас</a> или създайте билет в <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">системата за техническа подръжка</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Посетете този линк за да направите дарение на seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Пакет локални търсачки</h1>  \r\n        <p> \r\n            Добавяне <b>локализирани домейни на търсачка</b> - google,yahoo,msn(<b>например: www.google.de,www.google.fr\r\nи др.</b>) към SEO panel за <b>позиция по ключова дума</b>, за да следите локалните резултати за вашите сайтове. \r\n            За да добавим пакета за локални търсачки (според вашите изисквания), моля <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">направете дарение</a> от 10 $ или повече. Дарението ще се използва за подобряване на seo panel. \r\n            Преди да изпратите даренията, моля <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">свържете се с нас</a> за да ни предоставите списък с желаните домейни на търсачки за локално търсене. \r\n            <br><br>               \r\n            Също така, за да добавим <b>нови търсачки (напр.:baidu.com)</b> към проверката на позиция по ключова дума към вашият seo panel,\r\nмоля <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">свържете се с нас</a> или създайте билет в <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">системата за техническа подръжка</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Посетете този линк за да се свържете с нас</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Seo Panel Модули</h1>  \r\n        <p> \r\n            Добавете <b>seo модули</b> към вашият seo panel за да <b>разширите възможностите му</b>, според вашите нужди. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel модулите</a> се разработват, както от екипа на seo panel, така и от други разработчици. \r\n            Можете лесно да <b>разработите</b> seo модули за вашият seo panel. \r\n            Можете да ни <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">изпратите</a> вашият seo модул за seo panel и ние ще го <b>публикуваме</b> на нашият сайт след като го <b>прегледаме</b>.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Посетете този линк за да изтеглите последните seo panel модули</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Връзка с нас</h1>  \r\n        <p> \r\n            Свържете се с нас за всякакви въпроси свързани с <b>инструментите, модулите, опциите и т.н. на seo panel </b> като използвате линка по-долу.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Посетете този линк за да се свържете с нас</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Система за техническа подръжка</h1>  \r\n        <p> \r\n            За да получите <b>техническа подръжка</b> от екипа на seo panel относно <b>инсталирането, модулите, инструментите и опциите на seo panel</b>. Например: Да настройте cron за проверката на позиция по ключова дума. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Посетете този линк за да създадете билет в системата за техническа подръжка</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Докладване на бъгове(грешки)</h1>  \r\n        <p> \r\n            Докладвайте за <b>бъгове</b> в <b>инсталирането, модулите, инструментите, опциите и т.н. на seo panel</b> използвайки линка по долу.  \r\n           По този начин, ни помогате да подобрим работата на следащите версии на seo panel.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Посетете този линк за да докладвате за бъгове</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2010-11-14 11:47:30'),
(3424, 'bg', 'support', 'support_cont2', '<fieldset> \r\n<legend>SEO Panel - Онлайн ресурси</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Seo Panel - Помощна информация</h1>  \r\n        <p> \r\n            Можете да разгледате <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">документацията на SEO panel</a> в <b>помощната информация</b>. Съдържа <b>документация</b> за инструментите на SEO panel, модулите и различните функционалности. \r\n            <br>Най доброто място в интернет, където можете да <b>получите помощ</b> относно SEO panel. Надяваме се да\r\n<b>допълвате</b> помощната информация на seo panel, ако намерите някакви грешки или нещо липсва.                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Посетете секцията Помощна информация</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Форум Seo Panel</h1>  \r\n        <p> \r\n            Мястото за дискусии на първият в света <b>seo контролен панел</b> с отворен код.  \r\n            Най-доброто място да откриете <b>отговори</b> на вашите <b>въпроси</b> относно seo panel.  \r\n            <br>Също така можете да <b>споделите</b> вашият <b>опит</b> в използването на seo panel за оптимизиране на вашите уеб сайтове.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Посетете форума на seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2010-11-14 11:47:30'),
(3425, 'bg', 'support', 'support_cont3', '<fieldset> \r\n<legend>Направете дарение на SEO Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Направете дарение на Seo Panel - Първият в света, SEO контролен панел с отворен код</h1>  \r\n        <p> \r\n            <b>Направете дарение</b> на SEO panel за да подкрепите първият SEO контролен панел с отворен код в света. \r\n            Планираме да <b>добавяме и подобряваме</b> функционалността на SEO panel в бъдеще.  \r\n            <br>Заедно, с <b>вашата подкрепа</b> можем да постигнем нашите <b>цели</b>. \r\n            Ако смятате, че SEO panel си <b>струва</b>, моля дарете някаква сума на екипа на SEO panel. \r\n            <br>Ще <b>публикуваме</b> вашето име и информация за вашият сайт на <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">страницата с дарители</a>, след като получим дарението ви. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Посетете този линк за да направите дарение на SEO panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset> ', '2010-11-14 11:47:30'),
