(3490, 'pt', 'support', 'support_cont1', '<fieldset>\r\n<legend> Seo panel sistema de suporte </legend>\r\n<ul class=\\"infobox\\"> \r\n<li>\r\n<h1> Pacote de 1000 directórios </h1>\r\n<p>\r\nNós estamos fornecendo <b>um pacote de 1000 activos e verificados </b> inserções em directórios da internet, para adicionar no seu Seo panel <b> na ferramenta de submissão de directórios </b>.\r\nVai ajudar você a aumentar <b> backlinks </b> a visibilidade dos seus sites.\r\nActualmente estamos a angariar<b> uma doacção para futuros desenvolvimentos </b>\r\npara o Seo Panel.\r\nPara obter a lista 1000 directórios <a href = \\"<?=SP_DONATE_LINK?>\\" target = \\"_blank\\"> doe </a>\r\nUS $ 20 ou mais para melhorar as características do Seo Panel.\r\nSe você tiver alguma dúvida sobre pacote de 1000 do directórios, por favor <a href = \\"<?=SP_CONTACT_LINK?>\\"\r\ntarget ="_blank"> contato nos </a> ou submeta um ticket no <a href = \\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget = \\"_blank\\"> Suporte Sistema </a>.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?> \\" Target ="_blank"> Visite este link para doar para seo panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n\r\n<li>\r\n<h1> Pacote de motores de busca Locais </h1>\r\n<p>\r\nAdicionar <b> motor de busca locais , domínios </b> do google, yahoo, msn (por exemplo, <b>: www.google.de, www.google.fr, etc </b>) para seo panel <b> palavra-chave verifica a posição </b>, para acompanhar a sua perfomance site localmente.\r\nPara obter pacotes de motores de busca locais (de acordo com sua exigência) <a\r\nhref = \\"<?=SP_DONATE_LINK?>\\" target =\\"_blank \\"> doar </a> US $ 20 ou mais para melhorar as características de seo panel.\r\nAntes de enviar doações, por favor <a href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Entre em contato </a> para fornecer-nos o domínio do motor de busca em questão.\r\n<br>\r\nTambém para adicionar <b> novos motores de pesquisa (por exemplo: baidu.com) </b> no seu seo panel e palavras-chave,\r\npor favor <a href = \\"<?=SP_CONTACT_LINK?>\\" target = \\" _blank\\">contato nos </a> ou abrir um ticket no <a\r\nhref = \\"<?=SP_SUPPORT_LINK?>\\" target = \\"_blank\\"> sistema de suporte </a>.\r\n</P>\r\n<p class=\\"visit\\"> \r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Visite este link para entrar em contacto connosco </a>\r\n</P>\r\n<br>\r\n</Li>\r\n\r\n<li>\r\n<h1>Seo plugins </h1>\r\n<p>\r\nAdicionar <b> plugins </b> ao seu Seo Panel para <b> estender os recursos </b> de acordo com a sua exigência.\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Seo Panel plugins </a> são fornecidos por Seo Panel e e por terceiros.\r\nVocê também pode facilmente desenvolver <b> </b> plugins de SEO para seu painel de seo.\r\nVocê pode <a href = \\"<?=SP_PLUGINSITE?> \\"Target =\\" _blank \\"> apresentar </a> o seu plugin para Seo, Seo Panel vai publicar <b> </b> no nosso site após testarmos o plugin.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Visite este link para obter os plugins para o Seo Panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1>Fale Connosco </h1>\r\n<p>\r\nEntre em contacto connosco para esclarecer qualquer dúvida sobre as ferramentas de  <b>Seo Panel, plugins e funcionalidades etc </b> usando o link abaixo.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Visite este link para contacto connosco </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n <h1>Tickets de Suporte </h1>\r\n<p>\r\nPara obter suporte técnico <b> </b> da equipe do Seo Panel para configurar as ferramentas do <b>Seo Panel, plugins e\r\nrecursos </b> Por exemplo:. Para configurar o cron para verificador de posição da palavra-chave.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?>\\" Target = \\"_blank\\"> Visite este link para criar um ticket de suporte </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1>Relatar bugs </h1> \r\n<p>\r\nRelatório de  <b> bugs </b> sobre ferramentas do <b> Seo painel, plugins e funcionalidades etc </b> usando o link abaixo.\r\npor favor, ajude-nos a melhorar as características das versões vindouras.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?> \\"Target =\\"_blank\\"> Visite este link para relatar bugs </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 18:21:31'),
(3491, 'pt', 'support', 'support_cont2', '<fieldset>\r\n<legend>  Recursos on-line do Seo Panel </legend>\r\n<ul class=\\"infobox\\"> \r\n\r\n<li>\r\n<h1>Guia de Ajuda do Seo Panel</h1>\r\n<p>\r\nVocê pode ver a <a href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> documentação de ajuda</A> do Seo Panel , que contém documentos dos recursos para as ferramentas do SEO Panel, plugins e afins.\r\n<br> É o melhor lugar na internet para <b> obter ajuda </b> sobre SEO Panel. Esperamos que você<b> possa contribuir </b> para o guia de ajuda do Seo Panel , caso você encontre erros ou coisas que faltam.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> Visite o guia de ajuda do Seo Panel </A>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1> Fórum do Seo Panel </h1>\r\n<p>\r\nUm lugar para discutir sobre a primeiro software livre do mundo de <b> controle de Seo</b>.\r\nÉ o melhor local para encontrar as respostas para <b>as suas perguntas </b> sobre SEO Panel.\r\n<br> Também você pode <b> partilhar</b> a sua experiência <b></B>, enquanto usa o SEO Panel para optimizar os seus sites.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_FORUM_LINK?>\\" Target = \\"_blank\\"> Visite Fórum do Seo Panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 18:21:31'),
(3492, 'pt', 'support', 'support_cont3', '<fieldset>\r\n<legend> Doações para Seo Panel </legend>\r\n<ul class=\\"infobox\\"> \r\n<li>\r\n<h1> Doações para Seo Panel - Primeiro software livre de controle Seo do mundo </h1>\r\n<p>\r\n<b> Doe </b> para o suporte do Seo Panel, o primeiro Seo de código aberto do mundo.\r\nEstamos planear <b> acrescentar e melhorar </b> características do Seo Panel no futuro.\r\n<br> Só com o seu apoio é nós podemos alcançar nossos objectivos.\r\nSe você acha que o Seo Panel preenche os <b>requisitos</b>, por favor doe alguma quantia para a equipa do Seo Panel.\r\n<br> Vamos <b> publicar </b> seu nome e informações do seu site <a href = \\"<?=SP_DONATE_LINK?>\\"\r\ntarget = \\"_blank\\"> página de doações </a>, quando recebermos a sua doação.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?>\\" Target = \\"_blank\\"> Visite este link para doar para seo painel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 18:21:31'),
