(4017, 'fa', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Welcome to Seo Panel - World\\''s\r\nfirst seo control panel for multiple websites</h1> \r\n        <p> \r\n            A complete <b>open source seo control panel</b> for managing <b>search engine optimization</b> of\r\nyour websites.  \r\n            Seo Panel is a <b>seo tool kit</b> includes latest hot seo tools to <b>increase and track</b> the\r\n<b>performace</b> of your websites. \r\n            It is a <b>free software</b> released under <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            The main feature of seo panel is its <b>extendability</b> by using <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo plugins</a>. \r\n            Any one can easily <b>develop and install</b> required plugins for their seo panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            This open source software was <b>released on January 2010</b>. \r\n            With in this <b>short period</b> of  time <b>thousands</b> of <b>web masters</b> are using this\r\nsoftware for <b>optimizing</b> their websites. \r\n            Use seo panel today itself and <b>enjoy</b> everything related to seo under a <b>single\r\nplatform</b>. \r\n        </p>', '2011-07-13 15:08:33'),
(4018, 'fa', 'home', 'home_cont2', '', '2011-07-13 15:08:33'),
