(4146, 'el', 'support', 'support_cont1', '<fieldset> \r\n<legend>Seo Panel Σύστημα Υποστήριξης</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>Πακέτο Καταλόγου 1000</h1>  \r\n        <p> \r\n            Σας παρέχουμε <b>1000 δωρεάν και ενεργά</b> πακέτα internet καταλόγων, ώστε να τα προσθέσετε \r\nστο seo panel σας με το<b>εργαλείο καταχώρισης καταλόγων</b>. \r\n            Αυτό θα σας βοηθήσει να <b>αυξήσετε τα backlinks</b> των websites σας. \r\n            Πρακτικά, η 1000 λίστα καταλόγου είναι <b>εισαγωγική</b> για να μαζευτούν χρήματα για τη <b>μελλοντική\r\n ανάπτυξη</b> του seo panel. \r\n            Για να παραλάβετε την λίστα καταλόγων 1000 παρακαλώ <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">δωρίστε</a>\r\n$10 ή λιγότερο για την βελτίωση των λειτουργιών και των εργαλείων του seo panel. \r\n            Αν έχετε ερωτήσεις για το πακέτο καταλόγων 1000, παρακαλώ <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">επικοινωνήστε μαζί μας</a> ή ανοίξτε ένα ερώτημα στο<a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">σύστημα υποστήριξης</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Επισκεφτείτε αυτόν το σύνδεσμο για να δωρίσετε στο seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Πακέτο Τοπικών Μηχανών Αναζήτησης</h1>  \r\n        <p> \r\n            Προσθέστε<b> domains τοπικών μηχανών αναζήτησης</b> για το google,yahoo,msn(<b>eg: www.google.de,www.google.gr\r\nκλπ</b>) στο seo panel <b> έλεγχος κατάταξης keyword</b>, ώστε να παρακολουθηθεί η απόδοση του site σας τοπικά. \r\n            Για να λάβετε το πακέτο των τοπικών μηχανών αναζήτησης(σύμφωνα με τις απαιτήσεις σας) παρακαλώ <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">δωρίστε</a> $10 ή περισσότερα για την βελτίωση των υπηρεσιών που προσφέρει το seo panel. \r\n            Πριν στείλετε την δωρεά, παρακαλώ <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">επικοινωνήστε μαζί μας</a> για να \r\nσας παρέχουμε την απαιτούμενη λίστα των domain μηχανών αναζήτησης. \r\n            <br><br>               \r\n            Επίσης, για να προσθέσετε <b>νέες μηχανές αναζήτησης(eg:in.gr)</b> στο seo panel εργαλείο ελέγχου κατάταξης keyword,\r\nπαρακαλώ <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">επικοινωνήστε μαζί μας</a> ή ανοίξτε ένα ερώτημα στο <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">σύστημα υποστήριξης</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Κάντε κλικ εδώ για να επικοινωνήσετε μαζί μας</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Seo Panel Plugins</h1>  \r\n        <p> \r\n            Προσθέστε <b>seo plugins</b> στο seo panel σας για να <b>επεκτίνετε τις δυνατότητες</b> σύμφωνα με τις\r\nαπαιτήσεις σας. \r\n            Τα <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> υποστηρίζονται από το seo panel\r\nαλλά και sites τρίτων. \r\n            Επίσης, μπορείτε εύκολα να <b>αναπτύξετε</b> seo plugins για το δικό σας seo panel. \r\n            Μπορείτε να <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">καταχωρίσετε</a> το seo plugin στο seo panel και\r\nεμείς θα το <b>δημοσιεύσουμε</b> στο website σας μετά από τον <b>επανέλεγχο</b> που κάνουμε.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Κάντε κλικ εδώ για να κατεβάσετε seo panel plugins</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Επικοινωνήστε μαζί μας</h1>  \r\n        <p> \r\n            Επικοινωνήστε μαζί μας για οποιεσδήποτε ερωτήσεις αφορούν τα <b>seo panel tools,plugins και δυνατότητες etc</b> χρησιμοποιώντας το ακόλουθο\r\nlink.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Κάντε κλικ εδώ για να επικοινωνήσετε μαζί μας</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Ερωτήματα Υποστήριξης</h1>  \r\n        <p> \r\n            Για να έχετε <b>τεχνική υποστήριξη</b> από τη ομάδα του seo panel που αφοροούν την εγκατάσταση των <b>seo panel tools,plugins and\r\nδυνατοτήτων</b>. Π.χ.: Για εγκατάσταση cron για έλεγχο κατάταξης keyword. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Κάντε κλικ εδώ για να δημιουργήσετε ένα ερώτημα υποστήριξης</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Αναφορά Bugs</h1>  \r\n        <p> \r\n            Αναφέρετε τα <b>bugs</b> για τα <b>seo panel tools,plugins των δυνατοτήτων κλπ</b> χρησιμοποιώντας το ακόλουθο link.  \r\n            Παρακαλώ βοηθήστε μας να βελτιώσουμε τις δυνατότητες στις επόμενες εκδόσεις.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Κάντε κλικ εδώ για να αναφέρετε  bugs</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2011-01-19 14:35:57'),
(4147, 'el', 'support', 'support_cont2', '<fieldset> \r\n<legend>Seo Panel Online Πόροι</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Οδηγός Βοηθείας Seo Panel</h1>  \r\n        <p> \r\n            Μπορείτε να διαβάσετε την <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">τεκμηρίωση του seo panel</a> στον <b>οδηγό βοηθείας</b>, ο οποίος περιλαμβάνει <b>τεκμηρίωση</b> για τα εργαλεία του seo panel, τα plugins και τα συναφή χαρακτηριστικά και δυνατότητες. \r\n            <br>Είναι το καλύτερο μέρος στο internet για <b>λήψη βοήθειας</b> στο seo panel. Ελπίζουμε ότι και εσείς θα <b>συμβάλλετε</b> στον οδηγό βοήθειας του seo panel, σε περίπτωση που βρείτε σφάλματα ή στοιχεία που λείπουν.\r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Επισκεφθείτε τον οδηγό βοηθείας του seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Seo Panel Forum</h1>  \r\n        <p> \r\n            Ένα μέρος για να συζητήσετε το πρώτο παγκοσμίως open source <b>seo control panel</b>.  \r\n            Είναι το καλύτερο μέρος για να βρείτε <b>απαντήσεις</b> στις <b>ερωτήσεις σας</b> για το seo panel.  \r\n            <br>Επίσης μπορείτε να <b>μοιραστείτε</b> την <b>εμπειρία σας</b> όσο χρησιμοποιείτε το seo panel για την βελτιστοποίηση των websites σας.\r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Επισκεφθείτε το seo panel forum</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2011-01-19 14:35:57'),
(4148, 'el', 'support', 'support_cont3', '<fieldset> \r\n<legend> Δωρίστε στο Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1> Δωρίστε στο Seo Panel - Το πρώτο Open source seo control panel παγκοσμίως</h1>  \r\n        <p> \r\n            <b>Δωρίστε</b> στο seo panel για την υποστήριξη του πρώτου open source seo control panel παγκοσμίως. \r\n            Σχεδιάζουμε να <b>προσθέσουμε και βελτιώσουμε</b> τις δυνατότητες του seo panel στο μέλλον.  \r\n            <br>Μόνο με όλη την <b>υποστήριξη σας</b> μπορούμε να επιτύχουμε τους <b>στόχους</b>. \r\n            Αν πιστεύετε ότι το seo panel <b>αξίζει</b> για σας, παρακαλώ δωρίστε ένα μερικό ποσό στην ομάδα του  seo panel.\r\n            <br>Εμείς θα <b>δημοσιεύσουμε</b> το όνομα σας και τις πληροφορίες του site στην <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">σελίδα δωρεάς</a>, μόλις παραλάβουμε την δωρεά. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Επισκεφθείτε αυτόν το σύνδεσμο για να δωρίσετε στο seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-01-19 14:35:57'),
