(4645, 'el', 'home', 'Directory Submission', 'Καταχώρηση Καταλόγου', '2011-07-07 19:16:51'),
(4646, 'el', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\"> Καλωσορίσατε στο  Seo Panel - το πρώτο παγκόσμιο control panel για πολλαπλά site</h1> \r\n        <p> \r\n            Ένα ολοκληρωμένο <b>seo control panel ανοικτού κώδικα</b> για την διαχείριση του <b>search engine optimization</b> των website σας.  \r\n            Το Seo Panel είναι μία <b>seo εργαλειοθήκη </b> η οποία περιλαμβάνει τα τελευταία hot seo εργαλεία για να <b>αυξήσετε και να παρακολουθήσετε</b> την\r\n<b>απόδοση</b> των website σας. \r\n            Είναι ένα <b>δωρεάν λογισμικό</b> δημοσιευμένο υπό την <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            Το κύριο χαρακτηριστικό του seo panel είναι η <b>επεκτασιμότητα</b> του με τη χρήση <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">seo plugins</a>. \r\n            Οποιοσδήποτε μπορεί εύκολα να  <b>αναπτύξει και να εγκαταστήσει</b> τα επιθυμητά  plugins για το δικό του seo panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Αυτό το open source λογισμικό <b>δημοσιεύτηκε τον Ιανουάριο του 2010</b>. \r\n            Μέσα σε αυτή την <b>σύντομη περίοδο</b> ανάπτυξης, <b>χιλιάδες</b> από <b>web masters</b> χρησιμοποιούν αυτό το λογισμικό <b>βελτιστοποιώντας</b> τα website τους. \r\n            Χρησιμοποιήστε το seo panel σήμερα και <b>απολαύστε</b> τα πάντα σχετικά με το seo κάτω από μια  <b>απλή πλατφόρμα</b>. \r\n        </p>', '2011-07-07 19:16:51'),
(4647, 'el', 'home', 'home_cont2', '<fieldset> \r\n<legend>Μείζονα Χαρακτηριστικά του Seo Panel <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Εργαλείο Αυτόματης Καταχώρησης σε Καταλόγους</h1> \r\n        <p> \r\n            Το εργαλείο Αυτόματης Καταχώρησης μας βοηθάει να <b>καταχωρήσουμε τα websites μας</b> σε μείζονες <b>δωρεάν και επί πληρωμή καταλόγους στο internet</b>. \r\n            Επίσης μπορούμε <b>να παρακολουθήσουμε τη κατάσταση</b> κάθε καταχώρησης μέσω <b>περιοδικού ελέγχου</b> χρησιμοποιώντας το <b>script ελέγχου κατάστασης</b> της καταχώρησης. \r\n            Η <b>Διαχείριση Καταλόγων</b> θα μας βοηθήσει να βρούμε κατά πόσον <b>ένας κατάλογος είναι ενεργός</b> ή όχι. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Ελεγκτής Κατάταξης Keyword</h1> \r\n        <p> \r\n            Ο Ελεγκτής Κατάταξης Keyword θα βρει την <b>κατάταξη στην μηχανή αναζήτησης</b> για <b>στοχευμένες λέξεις κλειδιά</b>\r\nγια το website σας και <b>τις αποθηκεύει </b> στο σύστημα. \r\n            Στον τομέα αναφοράς κατάταξης keyword, μπορούμε να δούμε τις <b>καθημερινές κατατάξεις</b> των λέξεων κλειδιών σε διαφορετικές μηχανές αναζήτησης με <b>όμορφα γραφήματα</b> και <b>λεπτομερείς αναφορές</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Site Auditor</h1> \r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. Αυτή θα μας βοηθήσει να δημιουργήσουμε <b>XML,HTML,TEXT</b> sitemap αρχεία για το website, ώστε να  <b>καταχωρηθούν</b> σε μηχανές αναζήτησης.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Ελεγκτής Google και Alexa Rank</h1> \r\n        <p> \r\n            Ο ελεγκτής Google και Alexa Rank θα βρει <b>την κατάταξη στο google</b> και την <b> κατάταξη alexa</b> στα websites και <b> αποθηκεύονται </b> στο σύστημα. \r\n            Στον τομέα <b>αναφορές κατάταξης</b>, μπορούμε να δούμε <b>καθημερινά</b> τις κατατάξεις στο google και alexa για κάθε website με <b>λεπτομερείς αναφορές</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Ελεγκτής Backlinks</h1> \r\n        <p> \r\n            Ο Ελεγκτής Backlinks - συνδέσμων επιστροφής θα βρει <b>τον αριθμό των backlinks</b> για τα websites σε διαφορετικές μηχανές αναζήτησης <b>(google,yahoo,msn etc)</b> και <b>αποθηκεύονται</b> στο σύστημα. \r\n            <br>Στον τομέα <b>αναφορές backlink</b>, μπορούμε να δούμε τις <b>καθημερινές μετρήσεις  backlinks</b> για κάθε website με <b>λεπτομερείς αναφορές</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Έλεγχος Κορεσμού Μηχανής Αναζήτησης</h1> \r\n        <p> \r\n            Με τον έλεγχος Κορεσμού Μηχανής Αναζήτησης θα βρούμε <b>τον αριθμό των indexed σελίδων</b> στα websites μας σε διαφορετικές μηχανές αναζήτησης<b>(google,yahoo,msn etc)</b> και θα <b>αποθηκευτούν</b> στο σύστημα. \r\n            Στον τομέα <b>Αναφορές Ελέγχου Κορεσμού Μηχανής Αναζήτησης</b>, μπορούμε να δούμε <b>τις καθημερινές μετρήσεις indexed σελίδων </b> για κάθε website με <b>λεπτομερείς αναφορές</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Seo Panel Plugins</h1> \r\n        <p> \r\n            Τα <b> μείζονα χαρακτηριστικά </b> του seo control panel αφορούν την <b>επεκτασιμότητα του</b>. \r\n            Προσθέστε <b> μείζονα plugins</b> στο seo panel σας <b>για επέκταση των χαρακτηριστικών</b> σύμφωνα με τις ανάγκες σας. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> παρέχονται από το seo panel και από sites τρίτων. \r\n            Μπορείτε και εσείς επίσης να <b>αναπτύξετε</b> seo plugins για το seo panel σας. \r\n            Μπορείτε να <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">καταχωρήσετε</a> τα seo plugin στο seo panel και να τα <b>δημοσιεύσετε</b> στο website σας μετά από την διαδικασία <b>επιθεώρησης</b> μας. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Δημιουργία Meta Tag</h1> \r\n        <p> \r\n            Η Δημιουργία Meta tag είναι ένα <b>seo panel plugin</b> για την δημιουργία <b>custom meta tags</b> για τα website μας. \r\n            Αυτό θα μας βοηθήσει να αποκτήσουμε <b>περισσότερες πληροφορίες</b> για το website στα <b>bots των μηχανών αναζήτησης</b> όσο αυτά ανιχνεύουν τα website μας. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-07-07 19:16:51'),
(4648, 'el', 'home', 'home_cont3', '<fieldset> \r\n<legend>Seo Panel Online Πηγές</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Seo Panel Online Πηγές Αναφοράς</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Επίσημο Site</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Λήψη του Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Επικοινωνήστε με το Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Οδηγός Βοήθειας</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Σύστημα Υποστήριξης</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> Δωρίστε στο Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2011-07-07 19:16:51'),
