(4653, 'el', 'settings', 'Click here to become a sponsor for Seo Panel', '<b>Δωρίστε $100</b> και γίνετε <b>υποστηρικτής</b> του Seo Panel.	', '2011-07-07 19:27:06'),
(4654, 'el', 'settings', 'seopanel_description', 'Ένα ολοκληρωμένο και δωρεάν control panel για την διαχείριση της βελτιστοποίησης των ιστοτόπων σας για τις μηχανές αναζήτησης. Περιλαμβάνει πολλά από τα δυνατά seo εργαλεία για την αύξηση και παρακολούθηση της απόδοσης των website σας. Είναι open source λογισμικό και μπορείτε και εσείς επίσης να αναπτύξετε τα δικά σας seo plugins για το Seo Panel.', '2011-07-07 19:27:06'),
