(4679, 'cs', 'support', 'support_cont2', '<fieldset> \r\n<legend>Online zdroje SEO panelu</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Nápověda SEO panelu</h1>  \r\n        <p> \r\n            Můžete se podívat do <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">dokumentace SEO panelu</a> v\r\n<b>nápovědě</b>, která obsahuje <b>dokumentaci</b> k SEO panelu, nástrojům, pluginům a k příslušným vlastnostem. \r\n            <br>Je to to nejlepší místo na internetu, kde <b>získáte nápovědu</b> o SEO panelu. Doufáme, že <b>přispějete</b> do nápovědy SEO panelu v případě, že objevíte chyby nebo chybějící věci.   \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Podívejte se do nápovědy SEO panelu</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Forum SEO panelu</h1>  \r\n        <p> \r\n           Místo k diskuzi o prvním otevřeném <b>ovládacím panelu pro SEO</b> na světe.\r\nJe to nejlepší místo, kde najít <b>odpovědi</b> na vaše <b>otázky</b> o SEO panelu.\r\n            <br>Můžete také <b>sdílet</b> vaše <b>zkušenosti</b> z toho, jak pomocí SEO panelu optimalizujete vaše stránky.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Navštivte forum SEO panelu</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2011-03-23 01:41:17'),
(4680, 'cs', 'support', 'support_cont3', '<fieldset> \r\n<legend>Podpořte finančně SEO Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Podpořte finančně SEO Panel - první open source ovládací panel pro SEO na světě</h1>  \r\n        <p> \r\n            <b>Podpořte finančně</b> Seo Panel - první open source ovládací panel pro SEO na světě \r\n            Chceme v budoucnu <b>přidávat a vylepšovat</b> funkce SEO panelu.  \r\n            <br>Pouze s vaší <b>podporou</b> můžeme dosáhnout našich <b>cílů</b>. \r\n            Pokud máte pocit, že SEO Panel je pro vás <b>přínosem</b>, prosíme podpořte finančně určitou částkou tým SEO Panelu. \r\n            <br>Jakmile obdržíme vaši finanční podporu, <b>zveřejníme</b> vaše jméno a informace o vašich stránkách na <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">stránce s dary</a>. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Navštivte tento odkaz, abyste mohli finančně podpořit SEO Panel.</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-03-23 01:41:17'),
(4681, 'cs', 'backlink', 'clickproceedbacklink', 'Vložte <b>po jednom URL na každou řádku</b>. Klikněte na <b>Provést</b>, aby byly zkontrolovány zpětné odkazy.', '2011-03-23 01:08:28'),
