(4863, 'cn', 'home', 'Directory Submission', '目錄提交', '2011-07-05 23:47:27'),
(4864, 'cn', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">歡迎來到Seo Panel - 全球第一款支 \r\n\r\n持多站點的開源SEO工具</h1> \r\n        <p> \r\n            一個完整的<b>開源seo 控制面板</b> 來控制你的站點<b>操作</b> . \r\n            Seo Panel 是一個擁有最前沿熱門的seo工具<b>增加和追踪</b> 你的站點表現的 \r\n<b>SEO工具包</b>. \r\n            它是一個<b>免費的軟件</b> 在遵循<b>GNU GENERAL PUBLIC LICENSE</b>協議下發布. \r\n            seopanel主要的功能是<b>擴展性</b> 通過使用<a href=\\"<?=SP_PLUGINSITE?>\\" \r\ntarget=\\"_blank\\">seo 插件</a>. \r\n            任何人都可以簡單<b>開發和安裝</b> 各自需要的插件. \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            這款開源軟件發布自<b>2010年1月</b>. \r\n            在這麼<b>少的</b>時間<b>上千</b><b>站長</b> 在用此軟件<b>操作</b> 他們的站點. \r\n            現在您可以在<b>同一個平台下</b>使用和<b>享受</b> seo的任何東西. \r\n        </p> ', '2011-07-05 23:47:27'),
(4865, 'cn', 'home', 'home_cont2', '<fieldset> \r\n<legend> Seo Panel主要功能<?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>自動目錄提交工具</h1> \r\n        <p> \r\n            自動目錄提交工具幫助我們<b>提交我們的站點</b>進入主要<b>免費和付費internet目錄</b>. \r\n            我們也可以每次使用<b>狀態檢查腳本</b>提交<b>定期檢查</b><b>追踪狀態</b>. \r\n            <b>目錄管理器</b>會幫助我們找出<b>目錄是否激活</b>. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>關鍵字位置查詢器</h1> \r\n        <p> \r\n           關鍵字位置查詢器會系統中找出你的站點的<b>目標關鍵字</b>在<b>搜索引擎的排名位置</b> \r\n並且 <b>存儲排名數據</b> . \r\n            在關鍵字報告區域, 我們可以通過<b>簡潔的圖表</b>和<b>詳細報告</b>看到<b>每日</b>關鍵字在不 \r\n\r\n同的搜索引擎排名的報告. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>站點審計器</h1> \r\n        <p>站點審計器可以<b>審計所有的SEO要素</b> 在一個網站上的所有頁面並且生成 \r\n<b>詳細報告t</b> 定位每一張網頁. 這將會有助於創建我們的<b>XML,HTML,TEXT</b>站點地圖文件來<b>提交</b> 給 \r\n\r\n搜索引擎.</p> \r\n    </li> \r\n    <li> \r\n        <h1>Google和Alexa排名查詢器</h1> \r\n        <p> \r\n            Google和Alexa排名查詢器會查詢<b>Google PageRank</b> 和<b>Alexa排名</b> 我們的站點並<b> \r\n\r\n存儲</b>在系統中. \r\n            在<b>排名報告</b> 中, 我們可以看到<b>每天</b>每個Google PR和Alexa排名<b>詳細報告</b>. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>反向鏈接查詢器</h1> \r\n        <p> \r\n            反向鏈接查詢器會在不同的搜索引擎中<b>(google,yahoo,msn 等)</b>找出>我們的站點的<b>反向鏈 \r\n\r\n接數量</b>並<b>存儲</b>到系統中. \r\n            <br>在<b>反向鏈接報告</b> 中, 我們可以通過<b>詳細報告</b>看到每個站點的<b>每天反向鏈接數 \r\n\r\n量</b>. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>搜索引擎收錄量查詢器</h1> \r\n        <p> \r\n            搜索引擎收錄量查詢器會查詢>我們的站點在不同的搜索引擎<b>(google,yahoo,msn 等)的<b>數量頁 \r\n\r\n面排名</b</b>並<b>存儲</b>到系統中. \r\n            在<b>搜索引擎收錄量查詢報告</b> 中, 我們可以通過<b>詳細報告</b>看到每個站點的<b>每天的頁 \r\n\r\n面收錄數量 \r\n</b>. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>Seo Panel 插件</h1> \r\n        <p> \r\n            SEO控制面板的<b>主要功能</b>是它的<b>擴展性</b>. \r\n            根據你的需求增到<b>seo插件</b>到你的seo panel<b>擴展功能</b>. \r\n            <a href=\\"<?=SP_插件ITE?>\\" target=\\"_blank\\">Seo panel 插件</a>由seopanel \r\n和第三方站點提供. \r\n            你可以為你的seo panel簡單<b>開發</b> seo插件. \r\n            你可以在<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submit</a>發布你的seo插件seo panel， \r\n\r\n在我們通過<b>審查</b> 處理之後就會<b>公佈</b> 在我們的站點. \r\n        </p> \r\n    </li> \r\n    <li> \r\n        <h1>Meta標籤生成器</h1> \r\n        <p> \r\n            Meta標籤生成器是一個為我們的站點創建<b>自定義Mta標籤</b>的<b>seo panel 插件</b>. \r\n            它幫助<b>搜索引擎機器人</b> \r\n爬行我們站點的時候獲得關於我們的站點<b>更多信息</b> . \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-07-05 23:47:27'),
(4866, 'cn', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel 在線資源</legend>\r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel 在線資源信息</h1>\r\n         \r\n         \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel 官方站點</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">下載Seo Panel</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel 例子</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">聯繫Seo Panel</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel 幫助嚮導</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel 論壇</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel 支持系統</a>\r\n        </p>\r\n         \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐贈Seo Panel</a>\r\n        </p>\r\n    </li>\r\n     \r\n</ul>\r\n</fieldset>\r\n', '2011-07-05 23:47:27'),
