(5010, 'cn', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel 幫助系統</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 目錄包</h1>\r\n        <p>\r\n            我們提供<b>超過1000個可用的</b>網絡目錄包,加到\r\n你的seo panel <b>目錄提交工具</b>.\r\n            它會幫助你<b>增加反向鏈接</b>你的站點.\r\n            在我們獲得捐贈後為seo panel<b>以為未來發展</b>,您將獲得<b>推薦</b>的1000目錄列表，.\r\n            想要獲得1000目錄列表請<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐贈</a>\r\n$10 或者更多 來改善 seo panel 的功能 .\r\n            如果你有任何問題關於1000目錄包,請<a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">聯繫我們</a>或者打開一個頁面<a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">幫助系統</a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">訪問這個鏈接捐贈seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n     \r\n    <li>\r\n        <h1>本地搜索引擎包</h1>\r\n        <p>\r\n            增加<b>本地搜索引擎域</b>google,yahoo,msn(<b>例如: www.google.de,www.google.fr\r\netc</b>) seo panel <b>關鍵字position checker</b>, 追踪你的站點行為本地.\r\n            為了獲得本地搜索引擎包(根據你的需求) 請<a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">捐贈</a> $10或者更多來改善功能seo\r\npanel.\r\n            捐贈之前, 請<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">聯繫我們</a> to\r\n提供給我們需要的搜索引擎域名列表.\r\n            <br><br>\r\n             增加<b>新的搜索引擎(例如:baidu.com)</b>你的seo panel關鍵字position checker,\r\n請<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">聯繫我們</a>或者打開一個頁面在<a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">幫助系統</a>.\r\n        </p>\r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">訪問這個鏈接聯繫我們</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n     \r\n    <li>\r\n        <h1>Seo Panel插件</h1>\r\n        <p>\r\n            增加<b>seo插件</b> 你的seo panel <b>擴展功能</b>根據你的\r\n需求.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel插件</a>由seo panel\r\n和第三方站點提供.\r\n            你可以easily <b>develop</b> seo插件來你的seo panel.\r\n            你可以<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">提交</a>你的seo plugin seo panel 並且\r\n我們會<b>發布</b>到我們的站點在<b>審查</b>之後.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">訪問這個鏈接為了獲得seo panel插件</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    <li>\r\n        <h1>聯繫我們</h1>\r\n        <p>\r\n            聯繫我們來任何問題關於<b>seo panel 工具,插件和功能等等</b> 通過以下鏈接.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">訪問這個鏈接聯繫我們</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    <li>\r\n        <h1>技術支持</h1>\r\n        <p>\r\n            為了獲得<b>技術支持</b>從seo panel團隊設置<b>seo panel工具,插件和\r\n功能</b>. 例如: 設置cron來關鍵字位置checker.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">訪問這個鏈接創建一個支持ticket</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    <li>\r\n        <h1>報告Bugs</h1>\r\n        <p>\r\n            報告<b>bugs</b> 關於<b>seo panel 工具,插件和功能等等</b> 通過以下鏈接.\r\n            請幫助我們在下個版本來改善功能.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">訪問這個鏈接報告bugs</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-05-04 02:59:39'),
(5011, 'cn', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel 在線資源</legend>\r\n<ul class=\\"infobox\\">\r\n         \r\n    <li>\r\n        <h1>Seo Panel 幫助嚮導</h1>\r\n        <p>\r\n            你可以看<a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">seo panel文檔</a>在\r\n<b>幫助嚮導</b>, 它包括<b>文檔</b>來seo panel 工具,插件和相關的\r\n功能.\r\n            <br>這是在因特網獲得關於seo panel幫助的<b>最好的地方</b>.如果你發現錯誤或者缺少東西,我們希望你seo panel 幫助嚮導<b>報告</b>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">訪問seo panel 幫助嚮導</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    <li>\r\n        <h1>Seo Panel論壇</h1>\r\n        <p>\r\n            一個地方討論關於世界上第一款開源的<b>seo control panel</b>.\r\n            這是最好的地方找到<b>答案</b> <b>你的問題</b> 關於seo panel.\r\n            <br> 你可以<b>分享</b>你的<b>經驗</b> 在使用seo panel來操作你的\r\n站點.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">訪問seo panel論壇</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>\r\n', '2011-05-04 02:59:39'),
(5012, 'cn', 'support', 'support_cont3', '<fieldset>\r\n<legend>捐贈 Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>捐贈Seo Panel - 世界上第一款開源的seo control panel</h1>\r\n        <p>\r\n            <b>捐贈</b> seo panel支持第一款開源的seo control panel世界上.\r\n            我們計劃<b>增加和提高</b> 功能seo panel 的在未來.\r\n            <br>有了你的<b>支持</b>我們才能達到我們的<b>目標</b>.\r\n            如果你覺得seo panel是<b>值得</b>你擁有, 請捐贈支持seo panel 團隊.\r\n            <br>我們<b>會公佈</b> 你的名字和站點信息在<a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">捐贈頁面</a>, 一旦我們獲得捐贈.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">訪問這個鏈接捐贈seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-05-04 02:59:39'),
