(6451, 'cs', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Vítejte v SEO panelu - prvním ovládacím panelu pro SEO spravujícím více webů</h1> \r\n        <p> \r\n            Kompletní <b>ovládací panel pro SEO s otevřeným kódem</b> pro správu <b>SEO optimalizace</b> vašich webů.  \r\n            SEO panel je <b>nástroj pro SEO</b>, který zahrnuje nejnovější a špičkové nástroje pro SEO, jež <b>zvyšují a sledují výkon</b> vašeho webu. \r\n            Je to <b>volný software</b> zveřejněný pod <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            Hlavní vlastností SEO panelu je jeho <b>rozšířitelnost</b> prostřednictvím <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">SEO pluginů</a>. \r\n            Kdokoliv může snadno <b>vyvíjet a instalovat</b> požadované pluginy pro svůj SEO panel. \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Tento volný software byl <b>uvolněn v lednu 2010</b>. \r\n            Během této <b>krátké doby</b> <b>tisíce správců webu</b> používají ten to softwarový nástroj k <b>optimalizaci</b> jejich webů. \r\n            Používejte SEO panel také a <b>užijte si</b> všeho co souvisí se SEO optimalizací pod <b>jedinou platformou</b>. \r\n        </p>', '2011-07-12 05:40:22'),
(6452, 'cs', 'home', 'home_cont2', '<fieldset> \r\n<legend>Hlavní vlastnosti SEO panelu<?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Automatic Directory Submission Tool</h1> \r\n        <p> \r\n            Automatic directory submission tool help us to <b>submit our websites</b> into to major <b>free\r\nand paid internet directories</b>. \r\n            We can also <b>track the status</b> of each submision through <b>periodical check</b> using\r\nsubmission <b>status checker script</b>. \r\n            <b>Directory manager</b> will help us to find out whether <b>directory is active</b> or not. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Keyword Position Checker</h1> \r\n        <p> \r\n            Keyword position checker will find the <b>search engine position</b> of <b>targetted keywords</b>\r\nof your website and <b>stores</b> it in the system. \r\n            In keyword position reports section, we can see the <b>daily positions</b> of keywords in\r\ndifferent search engines by <b>beautiful graphs</b> and <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Site Auditor</h1> \r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a\r\n<b>detailed report</b> about each page. This will help us to create <b>XML,HTML,TEXT</b> sitemap\r\nfiles of our website for <b>submit</b> to search engines.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Google and Alexa Rank Checker</h1> \r\n        <p> \r\n            Google and alexa rank checker will find <b>google pagerank</b> and <b>alexa rank</b> of our\r\nwebsites and <b>stores</b> it in the system. \r\n            In <b>rank reports</b> section, we can see the <b>daily</b> google and alexa rank of each website\r\nby <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Backlinks Checker</h1> \r\n        <p> \r\n            Backlinks checker will find <b>number of backlinks</b> of our websites in different search\r\nengines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system. \r\n            <br>In <b>backlink reports</b> section, we can see the <b>daily backlinks count</b> of each\r\nwebsite by <b>detailed reports</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Search Engine Saturation Checker</h1> \r\n        <p> \r\n            Search Engine Saturation checker will find <b>number of indexed pages</b> of our websites in\r\ndifferent search engines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system. \r\n            In <b>search engine saturation checker reports</b> section, we can see the <b>daily indexed page\r\ncount</b> of each website by <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Seo Panel Plugins</h1> \r\n        <p> \r\n            The <b>major feature</b> of seo control panel is its <b>extentability</b>. \r\n            Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your\r\nrequirement. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> are provided by both seo panel\r\nand third party sites. \r\n            You can also easily <b>develop</b> seo plugins for your seo panel. \r\n            You can <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submit</a> your seo plugin to seo panel and\r\nwe will <b>publish</b> it in our website after our <b>review</b> process. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Meta Tag Generator</h1> \r\n        <p> \r\n            Meta tag generator is a <b>seo panel plugin</b> for creating <b>custom meta tags</b> for our\r\nsite. \r\n            It will help us to give <b>more information</b> about our website to <b>search engine bots</b>\r\nwhile they crawl our website. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-07-12 05:40:22'),
