(6548, 'es', 'directory', 'Reciprocal Link', 'Enlace recíproco', '2011-07-13 01:22:38'),
(6551, 'fa', 'support', 'support_cont2', '<fieldset> \r\n<legend>منابع آنلاین سئو پنل</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>راهنمای سئو پنل </h1>  \r\n        <p> \r\n            شما می توانید ببینید  <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">  را مدارک سئو پنل </a> در\r\n<b>راهنما </b>, این شمال میشه  <b>مدارک </b> ابزارات سئو پنل و ویژگی های  مربوط به آن \r\n. \r\n            <br>این بهترین مکان در اینترنت است که  <b>کمک کرده بشه </b> درباره سئو پنل \r\n<b>کمک می کنیم </b> که راهنمای سئو پنل ,اگر شما ایرادی پیدا کردید یا چیزی از دست رفت .                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">نگاه کن به راهنمای سئو پنل </a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>فرم سئو پنل </h1>  \r\n        <p> \r\n            جایی برای بحث درباره اولین نرم افزار آزاد سئو در جهان  <b>سئو گنترل پنل </b>.  \r\n            بهترین جا برای پیدا کردن  <b>جواب </b> to <b>سوال هایتان </b> درباره پنل \r\n            <br>همچنین شما می توانید  <b>به اشتراک بگذارید </b>  <b>تجربیاتتان را </b> وقتی استفاده می کنید از سئو پنل برای بهبود سایتتان \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">مشاهده کنید فرم سئو پنل را </a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2011-07-13 13:21:49'),
(6552, 'fa', 'support', 'support_cont3', '<fieldset> \r\n<legend>پشتیبانی مالی </legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1> پشتیبانی کن از سئو پنل , اولین نرم افزار آزاد سئو در دنیا</h1>  \r\n        <p> \r\n            <b>پشتیبانی</b> کن از سئو پنل , اولین نرم افزار آزاد سئو در دنیا\r\n            ما برنامه داریم  <b>اضافه کنیم و بهبود ببخشیم </b> ویژگی های سئو پنل را در آینده \r\n            <br>با تمام  <b>پشتیبانی های شما </b> فقط ما میتوانیم دست پیدا کینم به <b>اهدافمان </b>. \r\n            اگر شما احساس می کنید که سئو پنل <b>ارزش </b> برای شما لطفا پشتیبانی کنید از تیم نرم افزاری آن \r\n            <br>ما  <b>انتشار خواهیم داد </b> اسم شما و اطلاعات شما را در  <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">صفحه پشتیبانی مالی </a>, اولین باری که ما دریافت کنیم کمک را . \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">برای کمک مالی کردن روی این لینک کلیک کنید </a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-07-13 13:21:49'),
